"AWCH01" : "<P><font size=4><B>Справка по добавлению клиента WPS</B></font></P><p><a name=internet></a><a name=meter></a>WPS является аббревиатурой для Wi-Fi Protected Setup (Безопасная настройка Wi-Fi). Этот процесс позволяет легко добавить к сети беспроводного клиента без необходимости конфигурировать такие настройки беспроводной сети как SSID, режим безопасности и пароль.<p>Можно добавить беспроводного клиента, выбрав метод Push Button или PIN-код.<p>При использовании метода Push Button для завершения процесса нажмите кнопку на устройстве-клиенте (аппаратную кнопку или программную кнопку в системе управления клиента).<p>При использовании метода PIN-код здесь нужно ввести PIN-код клиента. Одновременно необходимо запустить WPS-процесс на клиенте. PIN-код клиента можно найти в системе управления клиента.</p>",
