"SBSW09" : "<HR><A name=security></A> <B>Smart Connect</B><P>Включить Smart Connect — разрешить роутеру самостоятельно выбирать наилучший диапазон для соединений WiFi (2,4 ГГц или 5 ГГц). Smart Connect выполняет балансировку нагрузки на вашу сеть WiFi и оптимизирует использование сети. Для работы функции Smart Connect необходимо, чтобы в обоих диапазонах 2,4 ГГц и 5 ГГц использовалось одно и то же имя сети (SSID), одни и те же параметры системы безопасности и один и тот же пароль.</P><HR>",
