"SWSW13" : "<P><B>ВАЖНАЯ ИНФОРМАЦИЯ</B></P><P>WEP может функционировать только со скоростью передачи данных До 54 Мбит/с, а не со скоростью режима N.</P><P>Для обеспечения поддержки режима N (полная скорость передачи данных) компания NETGEAR рекомендует использовать WPA2-PSK [AES].</P>",
