"UBS018" : "<p>Функция ReadySHARE Cloud предоставляет удаленный доступ через Интернет к USB-накопителю, подключенному к USB-порту вашего роутера.</p><p><b>Инструкции по настройке ReadySHARE Cloud</b></p><p>Шаг 1. Вам необходимо иметь учетную запись ReadySHARE Cloud. Если такая учетная запись у вас отсутствует,<a class=&quot;&quot;linktype&quot;&quot; target=&quot;&quot;_blank&quot;&quot; href=&quot;&quot;https://readyshare.netgear.com/site/index.jsp?pid=4&src=device&quot;&quot;>нажмите здесь</a> для ее создания.</p><p>Шаг 2. На этой странице введите имя пользователя и пароль ReadySHARE Cloud, чтобы зарегистрировать с вашей учетной записью роутер и подключенное к нему USB-устройство.</p><p>Шаг 3. Снова войдите на web-сайт <a class=&quot;&quot;linktype&quot;&quot; target=&quot;&quot;_blank&quot;&quot; href=&quot;&quot;http://readyshare.netgear.com/&quot;&quot;>http://readyshare.netgear.com/</a>, используя свои учетные данные. Вы увидите USB-устройство, подключенное к роутеру.</p><p>Шаг 4. При первом входе вам потребуется загрузить клиентскую программу Windows, которая используется для безопасного соединения вашего ПК с USB-устройством роутера. Войдите в клиентскую программу, чтобы получить доступ к USB-устройству из любой точки сети.</p><p><b>Примечание.</b> Без этой клиентской программы вы можете просматривать содержание USB-устройства, но не можете открывать или изменять файлы</p>",
