"UAS031" : "<p>Функция ReadyCLOUD предоставляет удаленный доступ через Интернет к USB-накопителю, подключенному к USB-порту вашего роутера.</p><p><b>Инструкции по настройке ReadyCLOUD</b><br>Шаг 1. Вам необходимо иметь учетную запись ReadyCLOUD. Если у вас нет учетной записи, <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/index.html#page=manage&quot;>нажмите здесь, чтобы создать ее </a>, и выберите &quot;Создать учетную запись&quot;.<br>Шаг 2. Вернитесь на данную страницу роутера и введите ваше имя пользователя и пароль ReadyCLOUD, чтобы зарегистрировать с вашей учетной записью ReadyCLOUD ваш роутер и подключенное к нему USB-устройство.<br>Шаг 3. Войдите на веб-сайт <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/&quot;>http://readycloud-staging.netgear.com/</a> с помощью вашей учетной записи ReadyCLOUD. Отображается USB-устройство, подключенное к вашему роутеру.<br><b>Примечание</b>. Можно использовать дополнительное приложение для безопасного удаленного подключения с вашего компьютера или мобильного устройства к USB-устройству роутера.<br>Войдите в это приложение, чтобы получить доступ к USB-устройству из любой точки сети. <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/cloud_download.html&quot;>Нажмите здесь</a>, чтобы получить приложение для удаленного доступа.</p>",
