"UAS041" : "<P><font size=4><B>Справка по ReadyCLOUD</B></font></P><p>Функция ReadyCLOUD предоставляет удаленный доступ через Интернет к USB-накопителю, подключенному к USB-порту вашего роутера&nbsp;— где бы вы ни находились. Вы также можете предоставить доступ к USB-накопителю для друзей и близких.</p><p><b>Инструкции по настройке ReadyCLOUD</b></p><p><ul><li>Шаг&nbsp;1. Вам необходимо иметь учетную запись ReadyCLOUD. Если таковая отсутствует, нажмите ссылку на этой странице, чтобы перейти на страницу NETGEAR ReadyCLOUD для создания учетной записи. <br>Вам будет предложено ввести действительный адрес электронной почты, который будет использоваться, чтобы восстановить имя пользователя или пароль.<br><li>Шаг&nbsp;2. После выполнения шага&nbsp;1 необходимо вернуться на эту веб-страницу роутера и ввести имя пользователя и пароль ReadyCLOUD, чтобы зарегистрировать роутер и подключенное к нему USB-устройство.<br>Регистрацию необходимо выполнить через роутер NETGEAR. Вы не можете зарегистрировать роутер на веб-сайте NETGEAR ReadyCLOUD по адресу <a target=&apos;_blank&apos; href=&apos;http://readycloud-staging.netgear.com&apos;>http://readycloud-staging.netgear.com</a><br><li>Шаг&nbsp;3. Войдите на веб-сайт <a target=&apos;_blank&apos; href=&apos;http://readycloud-staging.netgear.com&apos;>http://readycloud-staging.netgear.com</a> с помощью учетной записи ReadyCLOUD. Отображается USB-устройство, подключенное к вашему роутеру. По умолчанию для вас доступно все содержимое USB-устройства. Можно создать новый общий ресурс, предоставляющий доступ к части содержимого USB-устройства в соответствии с уровнем полномочий пользователя.<br></ul></p><p><b>Примечание</b>. Можно использовать дополнительное приложение для безопасного удаленного подключения с вашего компьютера или мобильного устройства к USB-устройству роутера.<br>Войдите в это приложение, чтобы получить доступ к USB-устройству из любой точки сети. <a target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/cloud_download.html&quot;>Нажмите здесь</a>, чтобы получить приложение для удаленного доступа.</p><p><b>Имя пользователя и пароль</b></p><p>Это имя пользователя и пароль созданной вами учетной записи ReadyCLOUD.<br> Роутер и USB-накопитель будут доступны только после регистрации. Интернет-соединение между роутером и сервером ReadyCLOUD будет активно до отмены регистрации.<br> Вы сможете зарегистрировать этот роутер с другой учетной записью после отмены регистрации данной учетной записи.</p>",
