"UAS049" : "<p>ReadyCLOUD предоставляет удаленный доступ через Интернет к USB-устройству хранения данных, подключенному к USB-порту роутера. Для использования ReadyCLOUD необходимо иметь учетную запись ReadyCLOUD. Если у вас нет учетной записи ReadyCLOUD, <a id=&quot;link_rc_info1&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>нажмите здесь</a>, затем выберите <b>Вход > Создать учетную запись</b>. </p><p><b>Настройка ReadyCLOUD</b></p><p><ol><li>Подключите USB-устройство хранения данных к USB-порту роутера.</li><li>Введите имя пользователя и пароль для ReadyCLOUD в поля, представленные ниже, затем нажмите кнопку <b>Регистрация</b>. Ваш роутер и USB-устройство зарегистрированы в ReadyCLOUD.</li><li> Посетите веб-страницу <a id=&quot;link_rc_info2&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>http://readycloud.netgear.com</a>, нажмите &apos;Вход&apos;, введите имя пользователя и пароль для ReadyCLOUD, затем нажмите кнопку <b>Вход</b>.</li></ol></p><p>      Приложение ReadyCLOUD можно также использовать для обеспечения безопасного соединения между компьютером или мобильным устройством и USB-устройством хранения данных, подключенным к роутеру.<br>      <a id=&quot;link_rc_info3&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com/client/cloud_download.html&quot;>Нажмите здесь</a> для загрузки приложения ReadyCLOUD.</p>",
"UAS050" : "При регистрации роутера в ReadyCLOUD режим подключения этого роутера к Интернету изменится с &apos;Dial on Demand&apos; (Набор по требованию) на &apos;Always On&apos; (Постоянное подключение). Это необходимо для обеспечения удаленного доступа ReadyCLOUD к подключенному устройству хранения данных USB. Продолжить?",
