"UMS017" : "<P><font size=4><B>Справка по медиасерверам (настройки)</B></font></P> <P> Роутер можно использовать в качестве медиасервера ReadyDLNA, который обрабатывает мультимедиа в форме DLNA, совместимой с медиаплеерами, поддерживающими DLNA и UPnP AV. После этого можно воспроизводить видео и просматривать изображения на совместимых медиаплеерах, таких как Xbox360, PlayStation и Digital Entertainer Live компании NETGEAR.</P><P>Кроме того, можно включить медиасервер iTunes и воспроизводить музыку с вашего USB-устройства хранения данных с использованием iTunes и Apple Remote.</P><B><P> Включить медиасервер DNLA </P></B><P> Установите этот флажок, чтобы использовать роутер в качестве медиаплеера ReadyDLNA. </P><B><P> Включить поддержку TiVo </P></B><P> Установите этот флажок, чтобы разрешить устройствам TiVo воспроизводить мультимедиа на USB-устройстве хранения данных, подключенном к порту USB роутера.</P><B><P> Включить медиасервера iTunes (только музыка) </P></B><P> Установите этот флажок, чтобы использовать iTunes и Apple Remote для воспроизведения музыки на USB-устройстве хранения данных, подключенном к роутеру. При подключении USB-устройства к порту USB роутера отобразится музыкальная библиотека на USB-устройстве в приложении iTunes на вашем компьютере, работающем под управлением Mac или Windows. Медиасервер iTunes обеспечивает поддержку ряда форматов файлов, включая MP3, AAC, FLAC, WAV и WMA.</P><B><P> Введите код доступа, отображаемый в Remote App</P></B><P> Apple Remote — это приложение для устройств iPhone и iPad. Оно позволяет управлять воспроизведением музыки с USB-устройства на AirPlay-устройствах. При попытке добавления новой библиотеки в приложение Apple Remote отобразится код доступа из четырех цифр. Введите этот код доступа в поле и нажмите кнопку &apos;Разрешить управление&apos;. В приложении Apple Remote отобразится музыкальная библиотека USB-устройства, подключенного к порту USB роутера. </P><B><P> Имя медиасервера/устройства</P></B><P> Это имя медиасервера, используемого для медиасерверов DLNA и iTunes. Имя медиасервера совпадает с именем устройства. Имя по умолчанию — номер модели роутера. Чтобы изменить имя, нажмите ссылку &apos;Нажмите здесь, чтобы изменить имя устройства&apos; и введите новое имя.</P>",
