"UMSH01" : "<P><font size=4><B>Справка к меню &apos;Медиасервер (настройки)&apos;</B></font></P> <P>Установка этого устройства в качестве медиасервера ReadyDLNA позволяет воспроизводить видеоматериалы и изображения на совместимых с DLNA/UPnP AV медиаплеерах, таких как Xbox360, Playstation и NETGEAR Digital Entertainer Live.</p><p>ReadyDLNA означает, что это устройство предоставляет совместимым с DLNA/UPnP AV медиаплеерам доступ к медиаресурсам в DLNA-совместимой форме. </p> <ul><li><a name=dlna_enable></a><b>Включить медиасервер</b> – выбор этой опции позволяет данному устройству работать в качестве медиасервера.</li><li><a name=tivo_enable></a><b>Включить поддержку TiVo®</b> Посетите страницу http://kb.netgear.com/app/answers/detail/a_id/24316, чтобы узнать , как использовать эту функцию устройства TiVo.</li><li><a name=dev_name></a><b>Имя медиасервера</b> – это имя, которое отображается на медиаплеере.</li></ul> </p><p><b>Сканировать содержимое</b><ul><li><b>Автоматически обновлять базу данных  </b> Сканирование медиафайлов выполняется при каждом добавлении новых файлов в USB-устройство хранения данных ReadyShare. Сканирование медиафайлов может выполняться только в общей папке, для которой разрешен доступ для чтения с параметром &apos;Все – без пароля&apos;.</li><li>Можно также нажать <b>Повторное сканирование медиафайлов</b> для удаления текущей базы данных и немедленного выполнения нового полного сканирования.</li></ul></p>",
