"CLOH01" : "<P><font size=4><B>Справка к меню &quot;Журналы&quot;</B></font></P><p>Журнал представляет из себя список сайтов, которые посещали или пытались посетить пользователи сети. Если вы настраивали фильтрацию содержимого через меню &quot;Блокировка сайтов&quot;, журналы будут отображать данные о попытках посещения пользователями заблокированных ресурсов. Если у вас так же включено уведомление по электронной почте, вы будете получать отчеты на почтовый ящик. В противном случае можно просмотреть журналы здесь.</p><p><ul><li>Нажмите <b>Очистить журнал</b> для удаления всех записей журнала.</ul><p><ul><li>Нажмите <b>Обновить</b> для получения самой последней информации.</ul><p><ul><li>Нажмите <b>Отправить журнал</b> для отправки его на вашу электронную почту. Данная функция так же может быть очень полезной при тестировании вашего почтового ящика.</ul>",
