"CBSH01" : " <P><font size=4><B>Справка о блокировке сайтов</B></font></P> <p>При необходимости ограничить доступ к определенным сайтам в Интернете нужно настроить фильтрацию содержимого. Существует два способа отфильтровать содержимое: <ul><li>блокировка доступа к определенным доменам (например www.badstuff.com/XXX) или<li>блокировка сайтов, содержащих определенные слова (например ругательство или материалы явного сексуального характера). </UL></P><p>При попытке пользователей получить доступ к заблокированному сайту они получат сообщение: &laquo;Заблокировано NETGEAR&raquo;.</p><hr><a name=blocking></a><p><B>Чтобы включить блокировку сайта, выполните следующие действия.</B></p><ul>Щелкните <B>По расписанию</B> , чтобы включить блокировку сайта и заблокировать его в соответствии с параметрами на странице <I>Расписание</I>.</ul><ul>Щелкните <B>Всегда</B>, чтобы включить блокировку сайта, независимо от страницы <I>Расписание</I>.</ul><p><B>Примечание.</B> Можно выполнить настройку на странице <I>Расписание </I>при блокировке ключевого слова и имени домена.</p><p><B>Чтобы отключить блокировку сайта, выполните следующие действия.</B></p><p><ul>Щелкните <B>Никогда</B>, чтобы отключить блокировку сайта.</ul><hr><a name=toaddword></a></P><p><B>Чтобы заблокировать ключевые слова или домены в Интернете, выполните следующие действия:</B></p><ol><li>Выберите, когда включать <B>Блокировку ключевых слов</B> (Никогда, По расписанию, Всегда).</li><li>В окне с надписью <a name=toaddword></a> <B>Введите ключевое слово или имя домена здесь</B> введите слово или имя домена, которое необходимо заблокировать.</li><li>Щелкните <B>Добавить ключевое слово</B>.<li>В списке ниже появится слово или имя домена.</li><li>Продолжайте добавление имен и ключевых слов, пока не закончите.</li><li>По окончании щелкните <B>Применить</B>.</li></ol><a name=blocklist></a><p><B>Черный список.</B> Список под заголовком &laquo;Заблокированные сайты, содержащие эти ключевые слова или имена доменов&raquo; содержит текущий список элементов для блокировки.</p><a name=todelete></a><p><B>Чтобы удалить ключевое слово или имя домена, выполните следующие действия:</B></p><ol><li>Выберите слово или имя домена в списке.</li><li>Щелкните <B>Удалить ключевое слово</B>.</li><li>Продолжайте выбор и удаление имен и ключевых слов, пока не закончите.</li><li>Нажмите <B>Применить</B>.</li></ol><p><B>Чтобы удалить все ключевые слова и имена доменов, выполните следующие действия:</B></p><ol><li>Щелкните <B>Очистить список</B>.</li><li>Нажмите <B>Применить</B>.</li></ol><hr><a name=trusted></a><p><B>Чтобы позволить одному компьютеру иметь неограниченный доступ в Интернет, выполните следующие действия:</B></p><ol><li>Установите флажок <B>Позволить доверенному IP-адресу посещать заблокированные сайты</B>.</li><li>Введите IP-адрес для компьютера в области <B>Доверенный IP-адрес</B>. <BR>Необходимо ввести номер в последнее окно.</li><li>Нажмите <B>Применить</B>.</li></ol><a name=To></a><p><B>Чтобы позволить неограниченный доступ в Интернет, выполните следующие действия:</B></p><ol><li>Выберите <B>Никогда</B> в меню <B>Блокировка ключевого слова.</B></li><li>Нажмите <B>Применить</B>.</li></ol>",
