"CBEH01" : "<P><font size=4><B>Справка по службам блокировки</B></font></P><P><B>Службы блокировки</B> позволяют блокировать доступ к Интернету отдельным пользователям в местной сети на основе их IP-адресов. Например, можно ограничить использование определенных Интернет-служб, таких как поиск в сети (http) для каждого или просто нескольких людей в сети. Блокировку службы можно настроить на <B>Никогда</B>, <B>По расписанию</B> или <B>Всегда</B>. </P><HR><A name=block></A><P><B>Чтобы включить блокировку службы, выполните следующие действия:</B></P><UL>  <LI>Щелкните <B>По расписанию</B> , чтобы включить блокировку сайта и заблокировать его в соответствии с параметрами на странице <I>Расписание</I>. <LI>Щелкните <B>Всегда</B>, чтобы включить блокировку сайта, независимо от страницы <I>Расписание</I>. </LI></UL><BR><P><B>Чтобы отключить блокировку службы, выполните следующие действия:</B></P><P></P><P><UL>  <LI>Щелкните <B>Никогда</B>, чтобы отключить блокировку службы.</LI></UL><A name=table></A></P><P><B>Таблица службы</B> </P><P>В этой таблице есть все службы, которые в настоящее время будут заблокированы. При необходимости можно добавлять или удалять записи из таблицы.</P><A name=add></A><P><B>Чтобы добавить новую службу, выполните следующие действия:</B> <OL>  <LI>Нажмите кнопку <B>Добавить</B>. <LI>Введите данные на появляющемся экране. <LI>После окончания нажмите кнопку <B>Применить</B>. </LI></OL><A name=edit></A></P><P><B>Чтобы редактировать службу, выполните следующие действия:</B> <OL>  <LI>Выберите переключатель службы, которую необходимо редактировать. <LI>Нажмите кнопку <B>Редактировать</B>. <LI>При необходимости введите данные для службы. <LI>После окончания нажмите кнопку <B>Принять</B>. </LI></OL><A name=delete></A></P><P><B>Чтобы удалить службу, выполните следующие действия:</B> <OL>  <LI>Щелкните переключатель рядом со строкой в таблице. <LI>Нажмите кнопку<B> Удалить</B>, чтобы удалить выбранную службу. </LI></OL><HR></P><P><B>Чтобы сохранить или отменить изменения, выполните следующие действия:</B></P><P>Щелкните <A name=To></A><B>Применить</B>, чтобы сохранить новые настройки роутера. <BR>Щелкните <A name=cancel></A><B>Отмена</B>, чтобы отменить любые несохраненные изменения. </P>",
"CBEH02" : "<P><font size=4><B>Справка по настройке служб блокировки</B></font></P><p>    <i>Службы блокировки</i> Службы позволяют блокировать доступ к Интернету отдельным пользователям в местной сети на основе их IP-адресов. Кроме того, можно полностью предотвратить использование определенных Интернет-служб.<p><hr> <p><b>Чтобы Добавить/Редактировать службу:</b></p><ol><li>Выберите тип службы из раскрывающегося списка или выберите «Определяется пользователем», если в списке нет необходимого типа.<li>Чтобы установить «Определяется пользователем», необходимо выбрать протокол и ввести имя и диапазон индикатора номеров, используемого службой. Для известных служб эти поля заполнятся автоматически.<li>Установите параметр IP-адреса для определения блокируемых ПК. (Более подробную информацию см. ниже).<li>Щелкните <b>Добавить/Принять</b> для сохранения изменений.</ol><a name=ip></a><p><b>Службы фильтрации для</b> - определения компьютеров, которые необходимо заблокировать.<ul><li>Только этот IP-адрес. Только один (1) ПК будет заблокирован. Введите IP-адрес ПК для блокировки.<li>Диапазон IP-адресов. Группа ПК с определенным IP-адресом будет заблокирована. Введите первый и последний IP-адреса диапазона IP-адресов ПК для блокировки.<li>Все IP-адреса. Все ПК будут заблокированы.</ul><hr> <p><b>Чтобы сохранить или отменить изменения, выполните следующие действия:</b></p><p> По окончании щелкните <b>Добавить/Принять</b> для обновления таблицы <i>Службы блокировки</i>. <br> Щелкните <b>Отменить</b>, чтобы вернуться к предыдущим настройкам.</p>",
