"CSEH01" : "<P><font size=4><B>Справка к меню &quot;Расписание&quot;</B></font></P> <p>Если на странице <I>Блокировка сайтов</I> или <I>Блокировка служб </I>установлена фильтрация содержимого, можно задать расписание, в котором будет определено время блокировки и время свободного доступа. </p><a name=blocksch></a><p>Чтобы блокировать ключевые слова, службы или домены в Интернете по расписанию, выполните следующее:<ol><li>Выберите <B>Каждый день</B>.<BR>или<BR>Выберите один или более дней.</li><li>Если вы хотите полностью ограничить доступ в выбранные дни, выберите <B>Весь день</B>.<BR>или<BR>Если вы хотите ограничить доступ в определенное время в выбранные дни, введите время в полях <B>Начало блокировки</B> и <B>Конец блокировки</B>.<BR><B>Примечание.</B> Вводите значения времени в 24-часовом формате. Например, 10:30 утра будет 10 часов и 30 минут, а 10:30 вечера будет 22 часа и 30 минут.</li><li>Нажмите <a name=Apply></a><B>Применить</B>.</li></ol>",
"CSEH02" : "<P><font size=4><B>Справка по установке расписания</B></font></P><p>Если установлена фильтрация содержания на экране &apos;Блокировка веб-сайтов&apos; или блокировка служб на экране &apos;Блокировка служб&apos;, можно установить периоды блокировки/неограниченного доступа ресурсов по расписанию. </p><p name=blocksch id=blocksch></p><p>Чтобы заблокировать ключевые слова, службы или интернет-домены на основе расписания:<ol><li>Выберите один из следующих параметров:<b>Каждый день</b>.<br>Один или несколько дней.</li><li>Если вы хотите полностью ограничить доступ в выбранные дни, выберите <b>Весь день</b>.<br>Если требуется ограничить доступ в определенные интервалы времени в выбранные дни, введите время в поля <b>Начало блокировки</b> и <b>Окончание блокировки</b>.<br><b>Примечание.</b> Вводите значения времени в 24-часовом формате. Например, для 10:30 до полудня введите значения 10 часов и 30 минут, а для 10:30 после полудня введите значения 22 часа и 30 минут.</li><li>Перейти <p name=Apply id=Apply><b>Применить</b>.</p></li></ol>",
