"CEMH01" : "<P><font size=4><B>Справка по эл. почте</B></font></P><p>Когда кто-то в вашей локальной сети (LAN) пытается посетить заблокированный сайт, могут отправляться соответствующие оповещения. Журналы — это списки всех посещенных URL-адресов. Если вам требуется получать оповещения и журналы по эл. почте, расширьте настройки на этом экране.</p><p>Журналы в любой момент можно проверять вручную, просматривая экран &apos;Журналы&apos;. Если вам не требуется получать эл. почту, оставьте эти поля пустыми.</p><a name=receive></a><p><b>Чтобы получать оповещения и журналы по эл. почте, выполните следующие действия.</b><ol><li>Установите флажок <b>Включить уведомление по эл. почте</b> .</li><li>В поле <b>Сервер исходящей почты</b> введите сервер исходящей почты SMTP вашего ISP (например, smtp.myISP.com). <br>Если оставить это поле пустым, оповещения и журналы отправляться не будут.<br>Если ваш сервер исходящей почты требует аутентификацию, установите флажок <b>Мой сервер эл. почты запрашивает аутентификацию</b> и в соответствующих полях введите правильное имя пользователя и пароль. В настоящее время аутентификация с использованием SSL или TLS не поддерживается.<br><b>Совет.</b> Вы использовали эту информацию при установке программы эл. почты. Если вы не можете вспомнить ее, посмотрите настройки в вашей программе эл. почты.</br><li>В поле <b>Адрес эл. почты</b> введите адрес эл. почты, чтобы вы или кто-то еще получал оповещения и журналы. <br>Используйте полный адрес эл. почты (например, Jackie@myISP.com). </br><li><a name=alert></a>Если вы хотите получать по эл. почте оповещения о попытках подключения в вашей сети к заблокированным URL-адресам, установите флажок <b>Немедленная отправка оповещения</b> .<br></li><li><a name=schedule></a>Если вы не хотите отправлять журналы, выберите <b>Нет</b> в первом списке в области &apos;Отправлять журналы в соответствии с этим расписанием&apos;.<br> <br>Если же вы хотите отправлять журналы, выберите один из других параметров.<ul><li>Если вы выбрали <b>Еженедельно</b>, то выберите день недели.</li><li>Если вы выбрали <b>Еженедельно</b> или <b>Ежедневно</b>, выберите время дня для отправки эл. почты.</li></ul><a name=Apply></a><li>Нажмите <b>Применить</b> , чтобы применить изменения.</li></ol><a name=timezone></a><p><b>Часовой пояс.</b><p>Выберите местный часовой пояс. Это необходимо для правильной работы расписания.</p><p>Выберите автоматическое переключение на летнее время, если это необходимо в вашем регионе.</p>",
