"MBSH01" : "<p><font size=4><B>Справка по параметрам резервного копирования</B></font></p><p>На этой странице можно сделать резервную копию, загрузить или восстановить параметры по умолчанию текущего роутера. </p><p>После правильной работы роутера необходимо сохранить доступную резервную копию информации, которую можно будет использовать в случае неполадок. После сохранения резервной копии параметры сохраняются в качестве файла на компьютере. Параметры роутера можно восстановить из файла. </p><a name=save></a><p>Чтобы создать резервную копию файла, необходимо выполнить следующие настройки.<ol><li>Щелкните   <B>Резервная копия</B>.</li><li>Если обозреватель не настроен для автоматического сохранения загруженных файлов, сохраните файл в нужную папку, переименуйте его и щелкните <B>Сохранить.</B> <BR>Если обозреватель настроен для автоматического сохранения загруженных файлов, файл сохраняется в папку загрузки обозревателя на жестком диске и называется <B><I>",
"MBSH02" : "</I></B><I></I>. </li></ol><hr></P><p><B>ВАЖНО! </B>После того как началось сохранение параметров или удаление роутера, НЕ пытайтесь выйти в Интернет, выключить роутер, завершить работу на компьютере или произвести любое другое действие с марштуризатором, пока он не перезапустится. Это займет около минуты. Когда тестовый индикатор перестанет мигать, подождите несколько секунд перед началом работы с роутером. </p><hr><a name=restore></a><p>Чтобы восстановить параметры из файла резервного копирования, выполните следующие действия:<ol><li>Щелкните <B>Обозреватель</B>.</li><li>Найдите и выберите предыдущий сохраненный файл резервного копирования (по умолчанию <I><B>",
"MBSH03" : "</B></I>).</li><li>Щелкните <B>Загрузить</B>. <BR>Появится окно с сообщением об успешном восстановлении роутера до предыдущих параметров. роутер перезагрузится. Это займет около минуты.<BR><B>ВАЖНО! </B>Не пытайтесь выйти в Интернет, выключить роутер, завершить работу на компьютере или произвести любое другое действие с роутером, пока он не перезапустится. Когда тестовый индикатор перестанет мигать, подождите несколько секунд перед началом работы с роутером. </li><li>Закройте окно сообщения.</li></ol><a name=revert></a></P><p>Чтобы удалить текущие настройки и выполнить сброс роутера до оригинальных заводских настроек по умолчанию, выполните следующие действия:<ul><li>Щелкните <B>Восстановить</B>.<BR><B>ВАЖНО!</B> Не пытайтесь выйти в Интернет, выключить роутер, завершить работу на компьютере или произвести любое другое действие с роутером, пока он не перезапустится. Когда тестовый индикатор перестанет мигать, подождите несколько секунд перед началом работы с роутером. </ul></P><p>После восстановления настроек по умолчанию, пароль роутера будет <I><B>password</B></I>, IP-адрес локальной сети &#151; <B>192.168.1.1</B>, а роутер будет работать в качестве сервера DHCP в локальной сети и как клиент DHCP в Интернете. </p>",
