"MSPH01" : "<P><font size=4><B>Справка к меню &quot;Установка пароля&quot;</B></font></P><p> Используете страницу <I>Установка пароля,</I> чтобы изменить пароль для получения доступа к страницам <I>Настройки</I>, а <I>не</I> пароль учетной записи у провайдера. </P><p> Чтобы изменить пароль, выполните следующие действия. <ol> <li> Введите старый пароль. <BR>Паролем по умолчанию для роутера является слово <b>password</b>. <li> Введите новый пароль и введите его снова в поле <B>Повторить новый пароль</B> для его подтверждения. <BR>  <B>Примечание.</B> Убедитесь, что вы записали его в надежном месте. <li> Щелкните <B>Применить</B> для изменения пароля или <B>Отмена</B> для сохранение текущего пароля. </ol></P><p> <B>Примечание.</B> Если вы заранее сделали резервную копию настроек роутера, необходимо сделать новую резервную копию, чтобы файл настроек включал новый пароль. </p>",
"MSPH02" : "<P><font size=4><B>Справка по установке пароля</B></font></P><p> На экране Установить пароль можно изменить пароль для доступа к экрану Настройки (этот пароль <I>не используется</I> для учетной записи вашего интернет-провайдера). <p> Чтобы изменить пароль, выполните следующие действия: <ol> <li>Введите прежний пароль.   <BR>Пароль роутера, используемый по умолчанию: <b>password</b>.  <li>Введите новый пароль и подтвердите его в поле <b>Подтверждение пароля</b>.   <br>  <b>Примечание.</B> Запишите пароль и храните его в надежном месте.  <li>Нажмите <b>Применить</b>, чтобы изменить пароль, или <b>Отмена</b>, чтобы сохранить текущий пароль. </ol><p> <b>Примечание.</b> Если вы выполняли резервное копирование настроек роутера, то вам потребуется сделать новую резервную копию, чтобы файл настроек содержал новый пароль. </p><p><b>Включить восстановление пароля</b><br>NETGEAR рекомендует включить функцию восстановления пароля, если вы изменили пароль администратора роутера, используемый по умолчанию. В таком случае вы сможете легко восстановить забытый пароль. <p><b>Чтобы включить восстановление пароля, выполните следующие действия:</b><ol><li>Установите флажок <b>Включить восстановление пароля</b>.<li>Выберите два контрольных вопроса и укажите соответствующие ответы.<li>Нажмите кнопку <b>Применить</b> для сохранения изменений.</ol></p><p>При попытке доступа к роутеру через браузер появится окно регистрации. Если функция восстановления пароля включена, то при нажатии кнопки <b>Отмена</b> начнется процедура восстановления пароля. Чтобы восстановить пароль, необходимо ввести ответы на контрольные вопросы. Процедура восстановления пароля поддерживается браузерами Internet Explorer, Firefox и Chrome (браузер Safari не поддерживает эту процедуру).</p>",
