"MRUH01" : "<title>Справка</title><link rel=stylesheet href=help.css></head><h1>См. справку по языку</h1><p>Язык интерфейса пользователя отличается от языка, используемого в браузере; если вы хотите изменить язык интерфейса пользователя в соответствии с языком браузера, нажмите кнопку <B>Да</B>, в противном случае нажмите кнопку <B>Нет</B> </p>",
"MRUH02" : " <P><font size=4><B>Справка по мастеру обновления микропрограммного обеспечения</B></font></P>        <p>роутер может автоматически определить имеется ли обновление микропрограммного обеспечения в Интернете.</P><p>нажмите <B>Да</B>, если необходимо начать поиск обновлений сейчас.<BR>или<BR>Нажмите <B>Нет</B>, если не нужно выполнять поиск новой версий микропрограммного обеспечения.</P><p>Если необходимо проверить наличие новых версий, это можно сделать на веб-странице <I>Обновления для роутера</I>.</P><p>Если не требуется отображения этого сообщения при следующем выполнении входа, установите флажок &quot;<B>Не отображать это сообщение снова</B>&quot; и нажмите <B>Нет</B>.",
"MRUH03" : "   <P><font size=4><B>Справка по обновлениям языка интерфейса пользователя </B></font></P>     <p>Выбрав язык из списка <b>Выбрать язык</b>, можно использовать функцию Обновления языка интерфейса пользователя для проверки обновлений. Данная функция проверяет только наличие обновлений языка интерфейса пользователя, а не всей прошивки.<p>Нажмите кнопку <b>Проверить</b>, чтобы перейти на веб-сайт NETGEAR для получения новой версии языка интерфейса. <p>Если найдена новая версия, можно выбрать <b>Да</b> для установки новой версии или <b>Нет</b> для отмены обновления. ",
"MRUH04" : " <p><font size=4><b>Справка по обновлению роутера</b></font></p> <p>Установлены новые версии для программного обеспечения роутера с помощью экрана &apos;Обновление роутера&apos;.<a name=check></a> <p>Нажмите на кнопку <b>Проверить</b>, чтобы перейти на веб-сайт NETGEAR и получить <b>новые версии</b> программного обеспечения для роутера. После загрузки файла до обновления роутера этот файл необходимо разархивировать.    <p>Поставьте флажок, если нужно проверить наличие новой версии при запуске. <p><b>ВАЖНАЯ ИНФОРМАЦИЯ.</b> Щелкнув <b>Загрузить</b>, <i>не</i> прерывайте процесс отправки программного обеспечения на роутер и перезапуск роутера. Если процесс может быть прерван по каким-либо причинам, нажмите на <b>Отмена</b> чтобы сохранить текущее программное обеспечение роутера.</p><a name=locate></a><p><b>Найдите и выберите файл обновления на жестком диске.</b><ol><li>Перейдите по адресу www.NETGEAR.com и загрузите обновленное программное обеспечение.<li>Если это не выполняется автоматически, разархивируйте файл.<br>До продолжения работы рекомендуется ознакомиться с <i>Примечаниями к версии</i>.<li>Щелкните <b>Обозреватель</b>.<li>Найдите и выберите файл, который только что загрузили и разархивировали.<li>Щелкните <b>Загрузить</b>, чтобы отправить программное обеспечение на роутер.<br>Загружается новое программное обеспечение в роутере и перезапускает роутер.<br><b>Примечание</b>. Не пытайтесь выйти в Интернет, выключить роутер, завершить работу на компьютере или произвести любое другое действие с роутером, пока он не перезапустится. Когда индикатор готовности перестанет мигать, подождите несколько секунд перед началом работы.<li>Нажмите <b>Состояние роутера</b> и просмотрите версию микрокода, чтобы удостовериться в том, что на роутер установлено новое программное обеспечение. </ol><p><B>ВАЖНАЯ ИНФОРМАЦИЯ.</b> В некоторых случаях, например, при ключевых обновлениях, после обновления может возникнуть необходимость перенастроить роутер. Обратитесь к приложенному к программному обеспечению документу <i>Примечания к версии</i>, чтобы узнать, нужно ли будет перенастраивать роутер. <p>Если не удается обновить программное обеспечение таким способом, обратитесь к <i>Справочному руководству,</i> размещенному на веб-сайте технической поддержки продукта, чтобы узнать о других способах обновления программного обеспечения роутера.</p> ",
