"AAW050" : "<p><font size=4><B>Справка по беспроводному мосту</B></font></p><HR><p>Роутер можно использовать в режиме моста, соединяющего несколько устройств по беспроводному каналу стандарта 802.11ac с повышенной скоростью.<br>Включить режим моста. Позволяет включить или выключить режим моста.<br>Нажмите кнопку &apos;<b>Настроить параметры беспроводной сети в режиме моста</b>&apos;, чтобы указать параметры других роутеров, к которым будет подключаться данный роутер.<br>1. Можно выбрать частоту беспроводной сети (2,4 ГГц или 5 ГГц). Для режима 802.11ac выберите 5 ГГц.<br>2. В поле <b>Имя (SSID)</b> введите имя беспроводной сети (SSID).<br>3. В разделе &apos;<b>Настройки безопасности</b>&apos; выберите соответствующую кнопку переключателя.<br>4. При получении запроса введите парольную фразу (пароль WiFi, который используется при беспроводном подключении к другому роутеру).<br>5. Нажмите кнопку &apos;<b>Применить</b>&apos;.<br>Необходимо также выбрать одну из следующих настроек IP-адреса на этом мосту \&quot;Получить динамически от имеющегося роутера\&quot; либо \&quot;Использовать фиксированный IP-адрес (не рекомендуется)\&quot;.<br>Нажмите кнопку &apos;<b>Применить</b>&apos; на странице &apos;<b>Беспроводный мост</b>&apos;, после чего внесенные изменения начнут действовать.</p>",
