"AAW069" : "Одно имя сети WiFi (SSID) для обоих радиомодулей WiFi 2,4 ГГц и 5 ГГц",
"AAW070" : "Включить Smart Connect <96> Включить Smart Connect — в этом случае роутер самостоятельно выбирает наиболее подходящий диапазон WiFi для подключения. Для работы функции Smart Connect необходимо, чтобы для всех радиомодулей WiFi, для которых включена эта функция, использовалось одно и то же имя сети (SSID), одни и те же параметры системы безопасности и один и тот же пароль.",
