"AAWH18" : "<b>В качестве пути доступа к общему ресурсу ReadySHARE можно использовать имя устройства. По умолчанию используется путь доступа \\readyshare.</b></br></br> Если нажать кнопку <b>OK</b>, в качестве пути доступа к общему ресурсу ReadySHARE будет использоваться имя вашего устройства. </br>Если нажать кнопку <b>Отмена</b>, путь доступа к общему ресурсу ReadySHARE не изменится.",
