"ANMH01" : "<p><font size=4> <b> Настройки индикации мониторинга сети – справка  </b></font></p><p>Функция индикации мониторинга сети позволяет настраивать режим работы светодиодного индикатора в голубой полусферической кнопке. Включить или выключить этот индикатор можно либо нажатием на голубую полусферическую кнопку, либо с использованием настроек, представленных ниже. Пояснения по поводу характера мигания индикатора см. в разделе &apos;Справка&apos; в правой части. Настройки светодиодных индикаторов применяются только при включенном индикаторе.</p><a name=display></a><p><b>Состояние беспроводной передачи данных (по умолчанию)</b></p><p>Индикаторы мигают во время беспроводной передачи данных. Левый индикатор указывает на передачу входящих данных, а правый – на передачу исходящих данных.</p><p><b>Состояние гостевой сети</b></p><p>Индикаторы горят, когда включена функция гостевой сети, и мигают, когда к этой сети подключен компьютер.</p><p><b>Состояние функции Live Parental Controls</b></p><p>Индикаторы горят, когда включена функция Live Parental Controls, и мигают при блокировке попытки доступа.</p><p><b>Состояние счетчика трафика для широкополосной связи</b></p><p>Индикаторы мигают, когда интенсивность трафика достигает уровня предупреждения, и начинают гореть непрерывно, когда интенсивность достигает предварительно заданного предельного значения.</p><p><b>Сохранение или отмена изменений</b><ul><li>Для сохранения новых настроек роутера нажмите кнопку <b>Применить</b>.</li><li>Для отмены всех несохраненных изменений нажмите кнопку <b>Отмена</b>.</li></p>",
