"AWRH01" : "<P><font size=4><B>Справка по настройкам функции беспроводной ретрансляции</B></font></P> <a name=en_repeat></a> <p><B>Включить беспроводную ретрансляцию</B></p> <p>Включите эту функцию, если нужно использовать режим &quot;мост&quot; или режим &quot;ретранслятор&quot;, и затем выберите режим, подходящий для вашего окружения: </p><ul><p><li><a name=repeat></a><strong>Беспроводной ретранслятор </strong></P><p>В данном режим будет взаимодействовать ТОЛЬКО с другой беспроводной станцией, находящейся в режиме базовой станции. Нужно ввести в специальном поле MAC-адрес (физический адрес) другой беспроводной станции, находящейся в режиме базовой станции. Для защиты данного соединения может (и должен) использоваться WEP. </P><p><li><a name=base></a><strong>Беспроводная базовая станция </strong>  </P><p>Беспроводную базовую станцию следует выбирать, только если является главным узлом &quot;Master&quot; для группы беспроводных станций в режиме ретранслятора. Другие беспроводные станции должны быть приведены в режим &quot;ретранслятор&quot; с помощью MAC-адреса данного. Тогда станции будут посылать весь трафик на узел &quot;Master&quot;, а не взаимодействовать непосредственно друг с другом. Для защиты данного соединения может (и должен) использоваться WEP. </P><p>При его выборе необходимо ввести в специальные поля MAC-адреса других точек доступа. ",
