"AWN048" : "<p name=vpn_passthrough id=vpn_passthrough><b>Сквозной режим VPN</b></p><p>Данная опция позволяет пользователю включить или отключить функцию сквозного режима VPN. По умолчанию роутер поддерживает три типа протоколов сквозного режима VPN: IPSec, PPTP и L2TP.</p>",
