"ASRH01" : "<P><font size=4><B>Справка по статическим роутерам</B></font></P><p> Статические роутеры предоставляют информацию роутера, которую не удается узнать автоматически с помощью других значений. Это может произойти, если RIP выключен в LAN. (См. на стр. <I>Настройка IP</I> LAN). Все определенные статические маршруты появятся в таблице. Чтобы добавить или удалить роутер, работайте в области в таблице &quot;Статические роутеры&quot;.</p><hr><a name=str_table></a><p><B>Чтобы настроить статический роутер, выполните следующие действия:</B> </p><ol><li>Нажмите кнопку <B>Добавить</B>. </li><li>Введите имя роутера для этого статического роутера в поле <B>Имя роутера</B> в таблице.<BR>(Только для целей идентификации). </li><li>Выберите <B>Персональный</B> при необходимости ограничить доступ только локальной сетью. </li><li>Выберите <B>Активный</B> , чтобы сделать работу роутера более эффективной. </li><li>Введите<B> IP-адрес места назначения</B> конечного места назначения. </li><li>Введите <B>Маску подсети</B> для этого места назначения. <BR>Если это предназначено для одного хоста, введите 255.255.255.255. </li><li> Введите<B> IP-адрес шлюза</B>, который должен быть роутером на том же сегменте. </li><li>Введите число от 2 до 15 в качестве <B>Метрического </B>значения. <BR>Будет представлено количество роутеров в сети. Обычно, настройка до 2 или 3 работает лучше, но если это прямое подключение, установите значение 2. </li><li> Щелкните <B>Применить</B>, чтобы статический роутер вошел в таблицу. </li></ol><p><B>Чтобы отредактировать статический роутер, выполните следующие действия:</B> <ol><li>Щелкните переключатель рядом с роутером, который необходимо отредактировать. </li><li> Обновите информацию.<li>По окончании щелкните <B>Применить</B>.</ol></P><p><B>Чтобы удалить статический роутер, выполните следующие действия.</B> <ol><li>Щелкните переключатель рядом с роутером, который необходимо удалить. </li><li>Щелкните <B>Удалить</B>.</li><li>Щелкните <B>Применить</B>, чтобы статический роутер удалить из таблицы. </li></ol>",
