"ARMH01" : "<P><font size=4><B>Справка по удаленному управлению</B></font></P><p>  С помощью меню удаленного управления можно позволить пользователю Интернет настраивать, обновлять и проверять состояние роутера.</p><p> <b>ВАЖНО!</b><i> Убедитесь, что пароль роутера по умолчанию заменен на безопасный пароль.</i></p><hr><a name=turnon></a><p><b>Включение удаленного управления</b></p><p><ul> 1. Установите флажок <b>Включить</b> удаленное управление.<br> 2.Нажмите кнопку <b>Применить</b> для сохранения изменения.</ul> </ul> </p> <hr> <a name=address></a><p><b>Адрес удаленного управления</b></p><p>Это текущий адрес, используемый для управления роутером из Интернета. Для получения доступа к роутеру необходимо ввести IP-адрес WAN, затем двоеточие (:) и номер порта в адресную строку обозревателя. Например, если внешний адрес: 10.0.0.123, и используется порт 8080, в обозревателе необходимо ввести:</p> <p><screen>http://10.0.0.123:8080</screen></p><hr><a name=access></a><p><b>Разрешение удаленного доступа</b><p> Для обеспечения безопасности следует разрешить доступ только необходимым внешним IP-адресам. <p><ul>Щелкните <b>Только данный компьютер</b>, чтобы разрешить доступ только данному IP-адресу.</ul><p><ul>Щелкните <b>Диапазон IP-адресов</b>, чтобы разрешить доступ диапазону IP-адресов в Интернете. Введите начальный и конечный IP-адрес, чтобы определить разрешенный диапазон.</ul><p><ul>Щелкните <b>Все</b>, чтобы разрешить доступ всем в Интернете.</ul><hr><a name=port></a><p><b>Номер порта</b></p><p>Веб-обозреватель обычно использует стандартный для HTTP служебный порт 80. Для повышения уровня безопасности можно изменить номер порта веб-интерфейса удаленного управления, указав номер порта в соответствующем поле. Выберите число между 1024 и 65534, но не используйте номер какого-либо другого служебного порта.</p><hr> <p><b>Чтобы сохранить или отменить изменения, выполните следующие действия: </b></p><a name=To></a><p>щелкните<b>Применить</b>, чтобы применить изменения.<br>Щелкните <b>Отмена</b>, чтобы вернуться к предыдущим настройкам.</p>",
