"AAU008" : "<TR><TD nowrap><B>Теперь вы можете отключить это устройство.</B></TD></TR>",
"AAU009" : "<TR><TD nowrap><B>Сейчас это устройство не может быть остановлено. Попытайтесь остановить это устройство еще раз позже.</B></TD></TR>",
"AAUH01" : "<P><font size=4><B> Справка к меню &quot;Настройки USB-порта&quot;</B></font></P><P> Для обеспечения дополнительной безопасности роутер может быть настроен на работу только с USB-устройствами, доверенными для работы в режиме общего доступа. Для включения этой функции выберите &quot;Нет&quot; и щелкните &quot;Применить&quot;.</P><P> Для определения доверенных устройств щелкните &quot;Доверенные устройства&quot; </P>",
"AAUH02" : "<P><font size=4><B> Справка к меню &quot;Доверенные USB-накопители&quot; </B></font></P><P> Для обеспечения дополнительной безопасности роутер может быть настроен на работу только с USB-устройствами, доверенными для работы в режиме общего доступа. Для включения этой функции установите флажок &quot;Разрешены только доверенные устройства&quot; и щелкните &quot;Применить&quot;.</P><P> Для добавления устройства к списку доверенных USB-устройств:<OL><LI> Устройство должно быть подключено к роутеру.</LI><LI> После подключения устройства оно появляется в списке доступных USB-устройств </LI><LI> Выберите устройство и нажмите &quot;Добавить&quot; </LI></OL></P><P> Для удаления устройства из списка доверенных USB-устройств:<OL><LI> Выберите устройство в списке &quot;Доверенные USB-устройства&quot; </LI><LI> Нажмите &quot;Удалить&quot; </LI></OL></P>",
