"AUPH01" : "  <p><font size=4><B> Справка по UPnP </B></font></p><p>Универсальное подключение и воспроизведение (UPnP) помогает устройствам, таким как Интернет-приложения и компьютеры, получить доступ к сети и при необходимости подключиться к другим устройствам. Устройства UPnP могут автоматически обнаруживать службы с других зарегистрированных устройств UPnP в сети. </p><a name=turnon></a> <p><B>Включение UPnP</B></p><p>Для автоматической настройки устройства можно включить или отключить UPnP. Для UPnP включены параметры по умолчанию. Если они отключены, роутер не позволит устройствам контролировать ресурсы, например, переадресацию порта (отображение на карте) роутера. </p><a name=adv></a>  <p><B>Период объявления</B></p><p>Период объявления &#151; частота показа объявления (трансляции) роутером его информации UPnP. Это значение может быть от 1 до 1440 минут. Период времени по умолчанию &#151; 30 минут. Более короткий период обеспечивает получение контрольными точками информации о состоянии текущего устройства за счет дополнительного сетевого трафика. Более длительный период может компрометировать информацию о состоянии устройства, но может значительно уменьшить сетевой трафик.</p><a name=live></a>  <p><B>Время действия объявления</B></p><p>Время действия объявления измеряется в показах (разах) для отправки каждого пакета UPnP. Показ &#151; это количество раз, разрешенных для появления объявления UPnP до его исчезновения. Число показов может быть от 1 до 255. Время действия объявления по умолчанию составляет 4 показа, что прекрасно подходит для большинства домашних сетей. Если вы заметили, что некоторые устройства не обновляются или доступ к ним предоставляется неправильным образом, может понадобиться немного увеличить это значение.</p><a name=table></a><p><B>Таблица карты портов UPnP</B></p><p>Таблица портов UPnP отображает IP-адрес для каждого устройства UPnP, которое в настоящий момент получает доступ к роутеру и какие порты (внутренний или внешний) это устройство открыло. Таблица портов UPnP также отображает тип открытого порта и если этот порт является активным для каждого IP-адреса.</P><p><B>Сохранение, отмена и обновление таблицы</B></p><p>Щелкните <B>Применить</B>, чтобы сохранить новые настройки роутера. <BR>Щелкните <B>Отмена</B>, чтобы отменить любые несохраненные изменения. <BR>Нажмите <B>Обновить</B>, чтобы обновить таблицу карты портов и отобразить устройства UPnP, открытые в настоящий момент.",
