"ATMH01" : "<P><font size=4><B> Справка по счетчику трафика  </B></font></P><A name=internet></A><H2 class=helpfile> <b>Счетчик интернет-трафика  </b></H2><A name=meter></A><P><B> Включить счетчик трафика (Enable Traffic Meter)  </B> <BR> Установите этот параметр, если требуется регистрировать объем интернет-трафика, проходящего через интернет-порт роутера.<P><B> Контроль объема трафика (Traffic volume control by)  </B> <BR> Выберите этот параметр, если требуется ограничить объем интернет-трафика, проходящего через интернет-порт роутера.<UL><LI> Не ограничено (No Limit) - Если выбрана эта опция, то указанное ограничение не будет применяться при достижении заданного ограничения трафика.<LI> Только загрузка (Download only) - Если выбрана эта опция, то указанное ограничение будет применяться только для входящего трафика <LI> Оба направления (Both Directions) - Если выбрана эта опция, то указанное ограничение будет применяться только для входящего и исходящего трафика</UL><P><B> Контроль времени соединения (Connection time control)</B> <BR> Выберите эту опцию, если требуется регистрировать и ограничивать время использования интернет-соединения.<P><B> Месячное ограничение (Monthly Limit)  </B><BR> Введите месячное ограничение объема трафика или ограничение времени соединения.<P><B> Округлять объем данных для каждого соединения (Round up data volume for each connection by)</B> <BR> Некоторые поставщики интернет-услуг (ISP) начисляют плату за определенный объем дополнительных данных при установлении пользователями нового соединения. В этом случае в этом поле нужно ввести объем дополнительных данных.<A name=counter></A><H2 class=helpfile> <b>Счетчик трафика (Traffic counter)</b></H2><P><B> Сброс счетчика трафика (Restart traffic counter)</B><BR> Этот параметр определяет время перезапуска счетчика трафика. Выберите требуемое время и день месяца.<P><B> Сбросить счетчик сейчас (Restart Counter Now)</B> <BR> При нажатии этой кнопки выполняется немедленный перезапуск счетчика трафика.<A name=reached></A><H2 class=helpfile> <b> Контроль трафика (Traffic Control)  </b></H2><P><B> Отображать предупреждения (Pop up a warning message)</B><BR> При вводе ненулевого значения роутер будет выводить предупреждающее сообщение при достижении месячного ограничения объема данных/времени соединения после того, как будет достигнута заданная величина. Всплывающее сообщение может отображаться только в том случае, если открыто окно Состояние трафика (Traffic Status).<P><B> При достижении месячного ограничения (When the monthly limit is reached)</B><BR><P> Выберите требуемое действие(-я):<UL> <LI> Включить мигающий зелено-желтый индикатор интернет-соединения (Turn the Internet LED green/amber flashing) – индикатор интернет-соединения попеременно загорается зеленым и желтым цветом. <LI> Разъединить и выключить интернет-соединение (Disconnect and disable the Internet connection) - блокируется весь доступ к Интернету. </UL><A name=statistics></A><H2 class=helpfile><b> Статистика интернет-трафика (Internet Traffic Statistics)</b></H2><P> Отображается статистика по интернет-трафику, проходящему через интернет-порт. <BR> Если счетчик трафика не включен, эта статистика не предоставляется. <P><B> Состояние трафика (Traffic Status)</B> <BR><BR> При нажатии этой кнопки выводится текущая обновленная информация о состоянии использования интернет-трафика.<P></P>",
