"GD99" : "NETGEAR Downloader — это новая бета-функция, выпущенная для некоторых роутеров. Она позволяет эффективнее использовать полосу пропускания при отключении компьютера или использования вне дома, а также экономит время и энергопотребление. Например, можно запустить на роутере загрузку мультимедийного файла утром и взять ноутбук на работу, а по возвращении вечером домой файл будет загружен на USB-диск и готов к использованию.",
"GD100" : "Мы стараемся постоянно расширять возможности использования и функциональность данного компонента, поэтому мы бы хотели, чтобы вы помогли нам в этом, отправив по электронной почте ваши предложения, информацию о неполадках и вопросы по адресу xyz@netgear.com. Сотрудник NETGEAR обязательно в кратчайшие сроки свяжется с вами по электронной почте. Мы просим вас не обращаться в службу технической поддержки NETGEAR по поводу данной функции и не обсуждать ее на публичных форумах. Электронное письмо является наилучшим способом получения ответа. Благодарим за вашу помощь.",
