"GDH01" : "<p><font size=4><B>Загрузчик NETGEAR</B></font></p><p><b>Загрузчик NETGEAR</b> поддерживает протоколы HTTP, FTP, BT и eDonkey. При помощи загрузчика NETGEAR пользователь может использовать <b>роутер NETGEAR</b> для загрузки файлов из Интернета и сохранения их на USB-устройстве хранения данных без необходимости держать компьютер включенным.</p><hr><a name=green_path></a><b>Сохранить как путь:  </b>Указать путь для сохранения загружаемых файлов.</p>",
"GDH02" : "<p><b>Загрузка FTP/HTTP</b> позволяет пользователю загружать файлы из Интернета, используя протокол FTP/HTTP.</p><hr><p><a name=http_url></a><b>Ссылка на загрузку FTP/HTTP:  </b>Это адрес в Интернете, указывающий на URL-адрес файла, который нужно загрузить из Интернета. Ее формат — ftp:// или http://.<br><a name=http_name></a><b>Имя пользователя (необязательно):  </b>Это необязательное для заполнения поле. Введите сюда имя пользователя, если этого требует сервер. Максимальная длина имени пользователя равна 32 символам.<br><a name=http_password></a><b>Пароль (необязательно):  </b>Это необязательное для заполнения поле. Введите сюда пароль, если этого требует сервер. Максимальная длина пароля равна 32 символам.<br><b>Добавить:  </b>Нажмите кнопку \&quot;Добавить\&quot;, чтобы добавить новую задачу загрузки.<br><b>Сброс:  </b>Нажмите кнопку \&quot;Сброс\&quot;, чтобы сбросить все введенное содержимое.</p><hr><p><a name=http_table></a><b>Таблица сведений о загрузке</b></p><p><b>Пауза:  </b>Нажмите кнопку \&quot;Пауза\&quot;, чтобы приостановить задачу загрузки.<br><b>Возобновить:  </b>Нажмите кнопку \&quot;Возобновить\&quot;, чтобы возобновить задачу загрузки.<br><b>Удалить:  </b>Нажмите кнопку \&quot;Удалить\&quot;, чтобы удалить задачу загрузки.</p><hr><p><a name=http_table></a><b>Загруженные файлы</b></p><p><b>Удалить историю:  </b>Нажмите кнопку \&quot;Удалить историю\&quot;, чтобы удалить все завершенные задачи загрузки.</p>",
"GDH03" : "<p><b>BT Download</b> позволяет пользователям загружать файлы из Интернета при помощи протокола BT.</p><hr><p><a name=bt_loc></a><b>Местоположение торрент-файла: </b> Укажите местоположение торрент-файла, нажав кнопку \&quot;Обзор\&quot;, чтобы выбрать торрент-файл на ПК или USB-устройстве хранения данных.<br>",
"GDH04" : "<p><b>eDonkey Download</b> позволяет пользователям загружать файлы из Интернета при помощи протокола eD2K.</p><hr><p><a name=emule_url></a><b>Ссылка eDonkey Download:  </b>Это адрес в Интернете, указывающий на URL-адрес файла, который нужно загрузить из Интернета. Ее формат — ed2k://.<br>",
"GDH05" : "<p>Установить новую версию приложения NETGEAR Downloader можно на этой странице.</p><p><a name=check></a>Нажмите кнопку \&quot;<b>Проверка</b>\&quot;, а затем роутер автоматически проверит наличие <b>новой версии</b> приложения NETGEAR Downloader на веб-сайте <b>NETGEAR</b>. Если будет обнаружена новая версия, вы можете посетить веб-сайт <b>NETGEAR,</b> чтобы получить ее.</p>",
"GDH06" : "<P><font size=4><B>Справка по настройкам загрузчика NETGEAR</B></font></p><HR><a name=gd_down_speed></a><P><B> Макс. количество одновременно выполняющихся задач загрузки  </B><p>Определяет максимальное количество одновременно выполняющихся задач загрузки. Значение по умолчанию зависит от производительности центрального процессора роутера и объема установленной оперативной памяти.</p><P><B>Макс. скорость загрузки для каждой службы (0 — без ограничений)</B></P><p>Этот параметр ограничивает максимальную скорость загрузки для каждой задачи (ед. изм. Кбайт/с). Значение по умолчанию равно 0 (0 означает, что ограничений на скорость загрузки нет).</p><a name=gd_up_speed></a><p><B>Макс. скорость передачи для каждой службы (0 — без ограничений)  </B></p><p>Этот параметр ограничивает максимальную скорость передачи для каждой задачи (ед. изм. Кбайт/с). Значение по умолчанию равно 0 (0 означает, что ограничений на скорость передачи нет).</P><a name=gd_task_num></a><P><B> Включить автоматическое обновление состояния  </B><p>Включает автоматическое обновление состояния задачи загрузки. Если эта опция выключена, обновление состояния производится только при нажатии кнопки &apos;Обновить&apos;. Автоматическое обновление состояния требует больше процессорной мощности, поэтому при включении этой опции выполнение других функций роутера может замедлиться.</p><P><B> Посылать уведомление по эл. почте  </B><p>Включает отправку по эл. почте уведомления о завершении задачи загрузки. Настроить информацию об учетной записи эл. почты можно с помощью кнопки &apos;Настроить эл. почту&apos;. </p>",
