"TVMH_001" : "<B>FastTrack</B> При первом запуске FastTrack, нужно указать полосу пропускания, которую необходимо зарезервировать, и настроить кнопку для запуска FastTrack. Заполните все поля в этом окне и нажмите <B>Применить</B>, чтобы изменения настроек начали действовать. <B>Состояние FastTrack.</B> В этом поле указывается, включена или выключена в данный момент функция FastTrack. <B>Включить FastTrack.</B> По умолчанию функция FastTrack выключена, а кнопка на передней или задней панели активирует функцию WPS (Wi-Fi Protected Setup). (Если ваш беспроводной роутер не оснащен аппаратной кнопкой WPS, перейдите на вкладку FastTrack в пользовательском интерфейсе и настройте ее.) Включите функцию FastTrack, установив этот флажок. <B>Полоса пропускания, зарезервированная для доверенных IP-адресов</B> Укажите, какой процент полосы пропускания беспроводного роутера следует зарезервировать при подключении с доверенного IP-адреса. Это не позволит другим соединениям бесконтрольно использовать полосу пропускания. При подключении к роутеру с доверенного IP-адреса будет обеспечена гарантированная полоса пропускания для потоковых видеоприложений. Имеется четыре варианта: 50 %, 60 %, 70 % и 80 %. <B>Кнопка.</B> Кнопке, находящейся на передней панели можно присвоить одну из двух разных функций, WPS (по умолчанию) или FastTrack. Установите переключатель рядом с требуемым вариантом.",
