"IPMAC07" : "Убедитесь, что хотя бы одно устройство добавлено в таблицу. В противном случае, при активации функции IP-MAC Binding ни одно устройство не будет иметь доступ в Интернет.",
"IPMAC08" : "Защита от атак ARP",
"IPMAC09" : "Эта функция предназначена для защиты роутера от атак ARP. Когда эта функция включена, в качестве статической ARP-таблицы используется таблица резервирования адресов. ARP-ответы больше не будут отправляться по портам LAN. Устройства, не зарегистрированные в этой таблице, не будут иметь доступа в Интернет.<br />&#10;Чтобы включить эту функцию, установите флажок, представленный выше, и нажмите кнопку &quot;Применить&quot;. Затем нажмите кнопку &quot;Редактировать&quot;, представленную ниже, чтобы вручную настроить связку адресов IP-MAC.",
"IPMAC10" : "Если все устройства будут удалены из списка, то ни одно устройство не сможет получить доступ к интерфейсу роутера.",
"IPMAC11" : "Если правило настроено неверно, то ни одно устройство не сможет получить доступ к интерфейсу роутера.",
"IPMAC12" : "Используйте кнопку Редактировать, чтобы изменить таблицу резервирования адресов.",
"IPMACH01" : "Функция IP-MAC Binding позволяет ограничивать доступ в Интернет устройствам, подключенным к вашей локальной сети. Также, защищает от подмены IP-адреса пользователем. Это осуществляется путем привязки опреденного MAC-адреса к IP-адресу. В таблице Вы можете добавлять, удалять или редактировать список устройств. ВНИМАНИЕ! При активации функции IP-MAC Binding - устройства, которые не занесены в таблицу не будет иметь доступ в Интернет (только доступ в локальную сеть).",
"IPMACH02" : "Создайте список устройтв для использования функции IP-MAC Binding. Устройтсва можно выбрать из существующего списка или ввести вручную.",
"IPMACH03" : "<p><font size=4><B>Справка по связыванию адресов IP-MAC и защите от атак ARP</B></font></p><HR><p>Можно воспользоваться кнопкой Редактировать на экране, чтобы перейти непосредственно к таблице резервирования адресов.</p><p>Функция связывания адресов IP-MAC предназначена для защиты роутера от атак ARP. Когда эта функция включена, в качестве статической ARP-таблицы роутер использует таблицу связывания IP-MAC. Можно добавлять, удалять и редактировать связанные пары адресов IP-MAC в таблице. <B>ПРЕДУПРЕЖДЕНИЕ.</B> Устройства, не зарегистрированные в этой таблице, НЕ будут иметь доступа в Интернет. Убедитесь, что в этой таблице зарегистрирована по крайней мере одна пара адресов IP-MAC какого-либо устройства в локальной сети LAN.</p>",
