"ASMH01" : "<P><font size=4><B>Справка по SmartZone</B></font></P><p>SmartZone — это проприетарная функция Netgear для динамического улучшения качества беспроводных соединений в среде роутеров и повторителей Netgear. Она предоставляет сервисы динамического поиска лучшей точки доступа для беспроводного устройства, подключенного к сети SmartZone.</p><p>При включении SmartZone поддерживающие ее устройства обнаружат ближайшие устройства и объединятся в сеть SmartZone при условии, что они используют одинаковое имя беспроводной сети (SSID), настройки безопасности и пароль.</p><br><P><font size=4><B>Включить SmartZone</B></font></p><p>При включении устройство обнаруживает другие устройства SmartZone и взаимодействует с ними.</p><br><P><font size=4><B>Чувствительность роуминга</B></font></p><p>Этим параметром определяется интенсивность, с которой SmartZone динамически ищет более подходящую точку доступа для беспроводных устройств.</p><br><p><font size=4>",
"ASMH02" : "<P><font size=4><B>Справка по SmartZone</B></font></P><p>SmartZone — это проприетарная функция Netgear для динамического улучшения качества беспроводных соединений в среде роутеров и повторителей Netgear. Она предоставляет сервисы динамического поиска лучшей точки доступа для беспроводного устройства, подключенного к сети SmartZone.</p><p>При включении SmartZone поддерживающие ее устройства обнаружат ближайшие устройства и объединятся в сеть SmartZone при условии, что они используют одинаковое имя беспроводной сети (SSID), настройки безопасности и пароль.</p><br><p><font size=4><B>Топологическая карта беспроводной связи</B></font></P><p>Отображает все беспроводные устройства в сети SmartZone, включая роутер, повторитель и ваши устройства. Для получения детальной информации можно нажать на любой из указанных на карте узлов.</p><p>Если доступ к этой веб-странице осуществляется с беспроводного устройства, то оно помечается на карте желтым цветом.</p><br><p><font size=4><B>Изменить</B></font></P><p>Изменить имя хоста устройства SmartZone.</p><br><p><font size=4><B>Переключить</B></font></P><p>Изменить точку доступа, к которой подключается повторитель.</p><br><p><font size=4><B>Подключить</B></font></P><p>Принудительно подключить беспроводную станцию к другой точке доступа</p><br>",
"FBWIFI001" : "Facebook Wi-Fi — это приложение для предприятий малого бизнеса. Приложение превращает роутер в точку доступа Wi-Fi, что позволяет посетителям заходить на вашу страницу в Facebook и ставить отметки Нравится перед использованием бесплатного доступа к Интернету. ",
