"LEDS009" : "<p><font size=4><B>Справка по параметрам управления индикатором</B></font></p><HR><p>На странице &apos;<b>Параметры управления индикатором</b>&apos; можно включать или выключать мигание индикаторов <b>Internet</b>, <b>LAN</b>, <b>Wireless</b> и индикаторов интерфейса хранилища при передаче данных. Кроме того, здесь можно выбрать опцию &apos;<b>Отключить все индикаторы, кроме индикатора питания</b>&apos;.</p>",
"SWSC001" : "Используемые в данный момент SSID для диапазонов 2,4 ГГц и 5 ГГц не совпадают, для SMART CONNECT требуется, чтобы оба SSID совпадали. Сначала измените их.",
