"SWSC003" : "В настоящее время у вас установлены разные настройки WiFi для радиомодуля 2,4 ГГц и радиомодуля 5 ГГц. После нажатия кнопки &apos;Применить&apos; настройки для радиомодуля 5 ГГц будут установлены такими же, как и настройки радиомодуля 2,4 ГГц.",
