"DNH1" : "<p><font size=4><b>Справка по имени устройства</b></font></p><p><b>Имя устройства.</b> Данный роутер определяется именем устройства. Оно предоставляется клиентским устройствам, подключенным к роутеру, для распознавания этого устройства. </p><p>Оно должно начинаться с буквы и может содержать только буквы, цифры, символы ‘-‘ и ‘_’, [a-zA-Z]+[a-zA-Z0-9\-\_]. Максимальная длина составляет 16 символов</p>",
