"PLC016" : "<P><font size=4><B>Справка по настройкам DST</B></font></P><p><font size=3><B>Имя роутера DST</B></font></p><p>Мнемоническое или значимое имя для обозначения данного устройства DST. Длина имени не должна превышать 12 символов. По умолчанию имя устройства представляет собой название модели этого устройства. Можно изменить это имя и нажать кнопку &apos;Применить&apos;, чтобы сохранить новое имя.</p><p><font size=3><B>Настройки ключа шифрования для роутера DST</B></font></p><p>Предусмотрены 2 варианта установки ключа шифрования роутера DST.<br><br><b>Использовать текущий ключ шифрования:</b> при выборе этого режима в данном поле автоматически отображается текущий ключ шифрования. Нередактируемое поле. Если пользователь не менял этот ключ, в данном поле отобразится ключ шифрования по умолчанию. Ключ шифрования по умолчанию: HomePlugAV. Этот режим выбирается при каждом входе пользователя на страницу параметров DST и при обновлении этой страницы.<br><br><b>Создать новый ключ шифрования:</b> в этом поле можно ввести собственный ключ шифрования. Длина ключа шифрования не должна превышать 64 символов.</p><p><font size=3><B>Задать удаленные настройки DST:</B></font></p><p>Здесь приводится таблица со всеми обнаруженными устройствами DST. <br><B>Имя устройства:</B> список всех обнаруженных в сети устройств DST. Можно изменить это имя на описательное, например, &apos;Кабинет&apos; или &apos;Кухня&apos;. Длина имени не должна превышать 12 символов<br><B>Название модели:</B> номер модели данного адаптера DST.<br><B>MAC-адрес:</B> MAC-адрес данного устройства DST. Этот адрес также указан на этикетке устройства; этикетка может быть не видна, когда устройство подключено.<br><B>Состояние индикатора:</B> состояние индикатора удаленного устройства DST. Для индикатора удаленного устройства DST можно выбрать значения Вкл. и Выкл.<br><B>Ключ шифрования:</B> при выборе режима <I>Использовать ключ шифрования по умолчанию</I> данный флажок отображается серым цветом и не может быть снят. При выборе режима &apos;Создать новый ключ шифрования&apos; этот параметр НЕ отображается серым цветом и может быть снят или установлен. Если этот флажок установлен, удаленное устройство DST будет использовать тот же ключ шифрования, что и локальное устройство DST.<br></p><p><font size=3><B>Состояние индикатора</B></font></p><p>Пользователь может включать и выключать индикатор DST. По умолчанию индикатор включен.</p>",
"PLC017" : "<P><font size=4><B>Справка по состоянию DST</B></font></P><p><font size=3><B>Версия микрокода DST</B></font></p><p>Версия микрокода локального устройства DST.</p><p><font size=3><B>Состояние соединения DST</B></font></p><p>Состояние подключения локального устройства DST.</p><p><font size=3><B>Состояние удаленного адаптера DST</B></font></p><p>Версия микрокода локального устройства DST. <br><B>Имя устройства:</B> имя удаленного адаптера DST, обнаруженного в сети DST.<br><B>Название модели:</B> номер модели данного адаптера DST.<br><B>Скорость передачи данных (Мбит/с):</B> скорость, с которой устройство передает данные.<br><B>Скорость приема данных (Мбит/с):</B> скорость, с которой устройство принимает данные.<br><B>MAC-адрес:</B> MAC-адрес удаленного адаптера DST. Этот адрес также указан на этикетке устройства; этикетка может быть не видна, когда устройство подключено.<br><B>IP-адрес:</B> IP-адрес удаленного адаптера DST. <br><B>Версия микрокода:</B> версия микрокода удаленного адаптера DST.<br><B>Состояние индикатора:</B> состояние индикатора удаленного адаптера DST.<br></p>",
