"PLC051" : "<p><font size=&quot;4&quot;><b>Справка по настройкам DST</b></font></p><p><font size=&quot;3&quot;><b>Имя роутера DST</b></font></p><p>Мнемоническое или значимое имя для обозначения данного устройства DST. Длина имени не должна превышать 12 символов. По умолчанию имя устройства представляет собой название модели этого устройства. Можно изменить это имя и нажать кнопку &apos;Применить&apos;, чтобы сохранить новое имя.</p><p><font size=&quot;3&quot;><b>Настройки ключа шифрования для роутера DST</b></font></p><p>Предусмотрены 3 варианта установки ключа шифрования роутера DST. <br><br><b>Не изменять ключ шифрования:</b> это параметр по умолчанию, который отображается на этой странице настройки ключа после входа пользователя в систему. Для данного параметра никакую информацию указывать не требуется. Если пользователь выбирает данный параметр, после того как он нажмет кнопку &apos;Применить&apos;, нам не требуется изменять ключ или применять этот же ключ еще раз. Это означает, что сеть DST не будет отключена. <br><br><b>Использовать ключ шифрования по умолчанию:</b> при выборе этого режима в данном поле автоматически отображается ключ шифрования по умолчанию. Ключ шифрования сети по умолчанию: <b>HomePlugAV</b>. После нажатия кнопки &apos;Применить&apos; этот ключ шифрования сети по умолчанию будет применен на данном устройстве.<br><br><b>Создать новый ключ шифрования:</b> в этом поле можно ввести собственный ключ шифрования. Длина ключа шифрования не должна превышать 64 символов.</p><p><font size=&quot;3&quot;><b>Задать удаленные настройки DST:</b></font></p><p>Здесь приводится таблица со всеми обнаруженными устройствами DST. <br><b>Имя устройства.</b> Список всех обнаруженных в сети устройств DST. Можно изменить это имя на описательное, например, &apos;Кабинет&apos; или &apos;Кухня&apos;. Длина имени не должна превышать 12 символов <br><b>Название модели:</b> номер модели данного адаптера DST. <br><b>MAC-адрес:</b> MAC-адрес данного устройства DST. Этот адрес также указан на этикетке устройства; этикетка может быть не видна, когда устройство подключено. <br><b>Тип ключа:</b> тип ключа удаленного устройства DST. Существует два типа ключей: &apos;Открытый&apos; и &apos;Закрытый&apos;. <br><b>Ключ шифрования:</b> при выборе режима <i>Использовать ключ шифрования по умолчанию</i> данный флажок отображается серым цветом и не может быть снят. При выборе режима &apos;Создать новый ключ шифрования&apos; этот параметр НЕ отображается серым цветом и может быть снят или установлен. Если этот флажок установлен, удаленное устройство DST будет использовать тот же ключ шифрования, что и локальное устройство DST. <br><b>Состояния индикатора:</b> состояние индикатора удаленного устройства DST. Для индикатора удаленного устройства DST можно выбрать значения Вкл. и Выкл.<br></p>",
