"PLC066" : "Пароль для входа в веб-интерфейс",
"PLC067" : "Введите пароль для входа в систему управления адаптерами DST",
"PLC068" : "Примечание. Совершено более двух неудачных попыток обновления адаптера DST. Повторите попытку позже на странице &apos;Удаленное управление DST&apos;.<br>Чтобы пропустить установку, нажмите кнопку <b>Далее</b>.",
"PLC069" : "<P><font size=4><B>Справка по настройкам DST</B></font></P><p><font size=3><B>Имя роутера DST</B></font></p><p>Мнемоническое или значимое имя для обозначения данного устройства DST. Длина имени не должна превышать 12 символов. По умолчанию имя устройства представляет собой название модели этого устройства. Можно изменить это имя и нажать кнопку &quot;Применить&quot;, чтобы сохранить новое имя.</p><p><font size=3><B>Настройки ключа шифрования для роутера DST</B></font></p><p>Предусмотрены 3 варианта установки ключа шифрования роутера DST.<br><br><b>Не изменять ключ шифрования:</b> это параметр по умолчанию, который отображается на странице настройки ключа после входа пользователя в систему. Для данного параметра никакую информацию указывать не требуется. Если пользователь выбирает данный параметр, после того как он нажмет кнопку &quot;Применить&quot;, не потребуется изменять ключ или применять этот же ключ еще раз. Это значит, что сеть DST не будет отключена.<br><br><b>Использовать ключ шифрования по умолчанию:</b> при выборе этого режима в данном поле автоматически отображается ключ шифрования по умолчанию. Ключ шифрования сети по умолчанию: <i>HomePlugAV</i>. После нажатия кнопки &quot;Применить&quot; на данном устройстве будет применен ключ шифрования сети по умолчанию.<br><br><b>Создать новый ключ шифрования.</b> В этом поле можно ввести собственный ключ шифрования. Длина ключа шифрования не должна превышать 64 символов.</p><p><font size=3><B>Задать удаленные настройки DST:</B></font></p><p>Здесь приводится таблица со всеми обнаруженными устройствами DST. <br><B>Имя устройства.</B> Список всех обнаруженных в сети устройств DST. Можно изменить это имя на описательное, например, &apos;Кабинет&apos; или &apos;Кухня&apos;. Длина имени не должна превышать 12 символов<br><B>Название модели.</B> Номер модели данного адаптера DST.<br><B>MAC-адрес.</B> MAC-адрес данного устройства DST. Этот адрес также указан на этикетке устройства; этикетка может быть не видна, когда устройство подключено.<br><B>Тип ключа.</B> Тип ключа удаленного устройства DST. Существует два типа ключей: &quot;Открытый&quot; и &quot;Закрытый&quot;. Если текущий ключ — <i>HomePlugAV</i>, отображается тип ключа &quot;Открытый&quot;. В противном случае, тип ключа — &quot;Закрытый&quot;.<br><B>Ключ шифрования:</B> при выборе режима <I>Использовать ключ шифрования по умолчанию</I> данный флажок отображается серым цветом и не может быть снят. Если выбран параметр &quot;Создать новый ключ шифрования&quot;, этот флажок активен (НЕ отображается серым цветом) и может быть снят или установлен. Если этот флажок установлен, удаленное устройство DST будет использовать тот же ключ шифрования, что и локальное устройство DST.<br><B>Состояние индикатора.</B> Состояние индикатора удаленного устройства DST. Для индикатора удаленного устройства DST можно выбрать значения &apos;Вкл.&apos; и &apos;Выкл.&apos;.<br></p>",
