"EAggr_help001" : "<P><font size=4><B>Агрегирование портов Ethernet</B></font></P><p>Агрегирование портов Ethernet позволяет роутеру комбинировать порты Ethernet 1 и 2, передавая данные на поддерживающее устройство (например, NAS). Агрегирование портов Ethernet также называется агрегированием каналов, группированием портов и объединением портов.</p><p name=agg_setup id=agg_setup></p><p><b>Настройка среды</b><p><ol><li>Подключите устройство, которое поддерживает агрегирование портов Ethernet (например, NAS или сетевой коммутатор), к портам Ethernet 1 и 2 на роутере, используя кабели Ethernet.</li><li>Настройте агрегирование портов Ethernet на устройстве, которое подключено к портам Ethernet 1 и 2 на роутере.</li> Дополнительные сведения о настройке агрегирования портов Ethernet на устройстве см. в документации, поставляемой с устройством.<br></ol><p name=agg_config id=agg_config></p><p><b>Конфигурация роутера</b><p><ul><li>Выключить. Выключает функцию агрегирования портов Ethernet на роутере. Порты Ethernet 1 и 2 можно использовать как независимые порты Ethernet.<li>Динамически (IEEE 802.3ad). Роутер связывается с устройством, подключенным к портам Ethernet 1 и 2 на роутере, и проверяет, поддерживается ли на устройстве агрегирование портов Ethernet. <br>Если агрегирование поддерживается, роутер автоматически объединяет порты Ethernet 1 и 2. В противном случае порты Ethernet 1 и 2 функционируют как независимые порты Ethernet. </ul><p name=agg_status id=agg_status></p><p><b>Состояние агрегирования портов Ethernet</b><p><ul><li>Неактивно. Устройство агрегирования портов Ethernet не подключено к портам Ethernet 1 и 2 на роутере.<li>Активно. Устройство агрегирования портов Ethernet подключено к портам Ethernet 1 и 2 на роутере. </ul>",
"EAggr_help002" : "<P><font size=4><B>Агрегирование портов Ethernet</B></font></P><p>Агрегирование портов Ethernet позволяет роутеру комбинировать порты Ethernet 1 и 2, передавая данные на поддерживающее устройство (например, NAS). Агрегирование портов Ethernet также называется агрегированием каналов, группированием портов и объединением портов.</p><p name=agg_setup id=agg_setup></p><p><b>Настройка среды</b><p><ol><li>Подключите устройство, которое поддерживает IEEE-802.3ad LACP, например NAS или сетевой коммутатор, к портам Ethernet 1 и 2 на роутере, используя кабели Ethernet.</li><li>Настройте агрегирование портов Ethernet на том устройстве, которое подключено к портам Ethernet 1 и 2 на роутере</li> <li>Если вы подключаете порты 1 и 2 к коммутатору, перед тем как с помощью двух кабелей Ethernet подключить коммутатор к роутеру, убедитесь, что коммутатор поддерживает 802.3AD LACP и настроен должным образом.</li><li>Не подключайте неуправляемый коммутатор к портам 1 и 2, это приведет к неработоспособности вашей сети вследствие образования замкнутых контуров.</li><br>Дополнительные сведения о настройке агрегирования портов Ethernet на устройстве см. в документации, поставляемой с устройством. <br><br>Совет. Чтобы получить максимальную эффективность при использовании агрегирования портов, в случае проводных подключений используйте порт Ethernet 3 для подключения первого компьютера и порт Ethernet 4, 5 или 6 для подключения второго компьютера, это позволить повысить скорость передачи данных до 2 Гбит/с при агрегировании портов. Максимальная скорость между портами 4, 5 и 6 составляет 1 Гбит/с.<br></ol><p name=agg_config id=agg_config></p><p><b>Конфигурация роутера</b><p><ol><li>Отключить: выключает функцию агрегирования портов Ethernet на роутере. Порты LAN 1 и 2 функционируют.<li>Включить (LACP- IEEE 802.3ad): роутер связывается с устройством, подключенным к портам LAN 1 и 2, и проверяет, поддерживается ли на этом устройстве агрегирование каналов. <br>Если да, роутер автоматически объединяет порты LAN 1 и 2. В противном случае порты LAN 1 и 2 будут функционировать как обычные порты LAN.</ol><p name=agg_status id=agg_status></p><p><b>Состояние агрегирования портов Ethernet</b><p><ol><li>Неактивно: агрегирование каналов на устройстве, подключенном к портам LAN 1 и 2, не выполняется.<li>Активно: агрегирование каналов на устройстве, подключенном к портам LAN 1 и 2, выполняется.</ol>",
