"plex_026" : "<p><font size=4><b>Справка по медиасерверу Plex</b></font></p><a name=ip_tag></a><p>Медиасервер Plex управляет вашими аудио- и видеофайлами и фотографиями, которые хранятся на подключенном локально USB-накопителе, и транслирует эти медиафайлы на ваши устройства, например на настольные компьютеры, мобильные телефоны и планшеты.</p><p>Все эти устройства можно подключить к роутеру локально или удаленно. Для локального подключения к роутеру используйте проводное Ethernet-соединение или сеть WiFi.</p><p>По умолчанию медиасервер Plex включен. Однако вы можете отключить его, если не собираетесь использовать.</p><p>Если сервер Plex определит, что USB-накопитель не подключен к роутеру, сервер Plex будет недоступен, пока вы не подключите USB-накопитель.</p><p>Если подключено несколько USB-накопителей, можно указать один из них, который будет использоваться медиасервером Plex для хранения медиафайлов и связанных с ними метаданных.</p><p>Роутер периодически проверяет наличие обновленных версий сервера Plex, в которых доступны новые функции или исправление ошибок. Если будет обнаружена новая версия, необходимо выполнить вход в систему управления роутера и обновить версию медиасервера Plex вручную.</p><p>Если включено автоматическое обновление, то при появлении новой версии медиасервера Plex роутер автоматически установит это обновление в 3:00. Это позволяет не прерывать трансляцию медиафайлов в дневное время.</p><p>Обратите внимание на то, что медиасервер Plex перезапускается после обновления версии и после cмены USB-накопителя.</p><p>Ваш роутер может использовать подключенную по протоколу Samba сетевую систему хранения данных (NAS) для хранения библиотеки медиафайлов сервера Plex. Добавьте сетевое подключение, следуя подсказкам в графическом интерфейсе роутера. Сведения о подключении отображаются на странице медиасервера Plex. Получите у производителя сетевого диска инструкции по предоставлению доступа к папке для других сетевых устройств.</p><p>Файлы метаданных и конфигурации Plex необходимо хранить на накопителях с портом USB 3.0. Объем памяти USB-накопителя должен составлять по крайней мере 5 ГБ.</p>",
