"ACBH_001" : "<p><font size=4><B>Справка по Cloud Backup</B></font></p><p><B>Для новых пользователей: зарегистрируйтесь здесь и получите возможность бесплатного использования учетной записи в течение 6 месяцев.</B> Если в данный момент у вас нет учетной записи Amazon Drive Cloud, вы можете получить на 6 месяцев бесплатную учетную запись, нажав ссылку и перейдя на веб-страницу Amazon Drive Cloud.</p><p><B>Для существующих пользователей: войдите в систему по этой ссылке.</B> Если у вас уже есть учетная запись Amazon Drive Cloud, для входа в нее перейдите по этой ссылке.</p>",
"ACBH_002" : "<p><font size=4><B>Справка по Cloud Backup</B></font></p><p><B>Войдите в систему или зарегистрируйтесь здесь.</B> Если у вас уже есть учетная запись Amazon Drive Cloud, для входа в нее перейдите по этой ссылке или зарегистрируйтесь здесь.</p>",
"ACBH_003" : "<p><font size=4><B>Справка по Cloud Backup</B></font></p><p>Кнопка <B>Применить</B>: кнопка &apos;Применить&apos; служит для сохранения любых изменений, внесенных на данной странице.</p><p>Кнопка <B>Отмена</B>: кнопка &apos;Отмена&apos; используется для восстановления предыдущих настроек.</p><p>Кнопка <B>Использовать другую учетную запись</B>: кнопка &apos;Использовать другую учетную запись&apos; служит для выхода из текущей учетной записи и возврата на страницу для входа.</p><p><b>Ваша учетная запись Amazon Drive Cloud</B>: в этом разделе отображается имя вашей учетной записи.</p><p><B>Настройка уведомлений по эл. почте</B>: нажмите эту ссылку, чтобы перейти на страницу управления уведомлениями по эл. почте.</p> <p><B>Состояние USB-устройства: подключено | Состояние USB-устройства: отключено —</B> здесь указывается текущее состояние подключения вашего USB-устройства.</p><p><B>Выбрать папку для резервного копирования</B>: выберите на USB-устройстве папку, резервную копию которой вы хотите создать в Cloud.</p><p><B>Изменить папку для резервного копирования</B>: после выбора папки вы можете изменить ее, нажав ссылку &apos;Изменить папку&apos;.</p><p>Кнопка <B>Выполнить резервное копирование сейчас</B>: кнопка &apos;Выполнить резервное копирование сейчас&apos; служит для немедленного запуска резервного копирования.</p><p><B>Выберите расписание резервного копирования:</B></p><ul><li><B>Синхронизация в реальном времени</B>: по умолчанию используется расписание резервного копирования &apos;Синхронизация в реальном времени&apos;, а это значит, что при каждом изменении данных на USB-устройстве их резервная копия в реальном времени создается в Cloud.</li><li><B>Резервное копирование по расписанию</B>: резервное копирование по расписанию означает, что вы можете выбрать день и время, когда будет выполняться резервное копирование данных в Cloud.</li></ul><p><b>Готово! Резервное копирование завершено</B>: это сообщение уведомляет о том, что последнее задание резервное копирование успешно выполнено.</p><p><B>Сбой при резервном копировании. Подробнее об ошибках >></B>: это сообщение уведомляет о том, что последнее задание резервного копирование не выполнено. Для получения более подробной информации нажмите &apos;Подробнее об ошибках&apos;.</p>",
