"usb_dev_setting_h=" : "<h1 class=\&quot;helpfile\&quot;>Справка по настройкам USB-накопителя</h1> <p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>DGN2200 позволяет совместно использовать файлы, когда к USB-порту подключен жесткий диск USB или флэш-накопитель.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Подробную информацию о конфигурации см. в Справочном руководстве.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Для доступа к USB-накопителю по FTP используйте какую-либо FTP-программу или введите ftp://readyshare в веб-браузере, например в Microsoft Internet Explorer или Firefox. Вводимый IP-адрес – это IP-адрес роутера в Интернете, который может быть указан в меню Состояние роутера, как IP-адрес интернет-порта. </span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Для доступа к USB-накопителю с использованием соединений сети Microsoft, нажмите в Windows Пуск -&gt; Выполнить... и введите \\readyshare. Вводимый IP-адрес – это локальный IP-адрес роутера, например 192.168.0.1. В качестве альтернативы можно в Проводнике Windows ввести \\hostname. Вводимое значение hostname – это имя хоста, указанное в разделе Сетевой доступ, например DGN2200.</span></p><hr><a name=\&quot;network access\&quot;> </a><h2>Сетевой доступ</h2><p class=\&quot;MsoNormal\&quot;><B>Имя хоста и рабочая группа </B></p><p class=\&quot;MsoNormal\&quot;> <span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Комбинация имени хоста и рабочей группы – это имя, используемое для идентификации роутера в вашей сети. Доступ к подключенному USB-накопителю можно легко получить, если в Проводнике Windows ввести \\hostname.</span></p><p class=\&quot;MsoNormal\&quot;> <B>FTP-порт</B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> FTP-порт – это номер TCP-порта встроенного FTP-сервера. По умолчанию используется значение 21. </span></p><hr><a name=\&quot;ftp access\&quot;></a><p class=\&quot;MsoNormal\&quot;> <B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> FTP-доступ</span></B></p><p class=\&quot;MsoNormal\&quot;> <span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Учетные записи FTP можно создавать, нажав кнопку Добавить. Эти учетные записи FTP позволят пользователям в LAN или Интернете осуществлять доступ к файлам на подключенном USB-накопителе.</span></p><p><B>Добавление, редактирование, удаление данных </B>или <B>извлечение диска</B><BR><BR>Для добавления новой информации нажмите кнопку <B>Добавить</B>. Для редактирования выбранной информации нажмите кнопку <B>Редактировать</B>. Для удаления выбранной информации нажмите кнопку <B>Удалить</B>. Для извлечения USB-накопителя нажмите кнопку <B>Извлечь диск</B>.<BR></p><hr><a name=\&quot;attached device\&quot;></a><p class=\&quot;MsoNormal\&quot;> <B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Подключенное устройство</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot;  style=\&quot;font-family:Arial\&quot;> В этой таблице представлена информация о разделах подключенного USB-накопителя, включая имя общедоступного ресурса и тип файловой системы. </span></p>",
