"usb_wiz_h=" : "<h1 class=\&quot;helpfile\&quot;>Справка по мастеру установки USB-накопителя</h1> <p>DGN2200 позволяет совместно использовать файлы, если к USB-порту подключен жесткий диск USB или флэш-накопитель. Подробную информацию о конфигурации см. в Справочном руководстве.</P><p>После подключения жесткого диска USB или флэш-накопителя к USB-порту DGN2200 пользователи в локальной сети могут осуществлять полноправный доступ к этому USB-накопителю для чтения и записи данных.</P><p>Пользователи из локальной сети или Интернета могут также обращаться к USB-накопителю с использованием FTP-доступа. Мастер установки поможет выполнить процедуру установки FTP.</P><P><a name=\&quot;folder\&quot;></a><b class=\&quot;helpfile\&quot;>Введите имя папки, которую предполагается открыть для общего доступа</b><BR>При обращении пользователя к файлам по FTP эта папка будет отображаться в качестве корневой.</P><P><a name=\&quot;loginname\&quot;></a><b class=\&quot;helpfile\&quot;>Ввод регистрационного имени FTP для получения доступа к этой папке</b><BR>Введите регистрационное имя для FTP, с использованием которого вы хотите получить доступ к этой папке.</P><P><a name=\&quot;password\&quot;></a><b class=\&quot;helpfile\&quot;>Ввод пароля для входа на FTP</b><BR>Введите пароль для входа на FTP.</P><p><a name=\&quot;rights\&quot;></a><b class=\&quot;helpfile\&quot;>Выбор прав FTP-доступа</b><BR>При выборе Только чтение пользователь сможет извлекать файлы данных с использованием FTP. При выборе Чтение и запись пользователь сможет извлекать файлы данных с использованием FTP.</p><p><B>Примечание.</B> Все сеансы FTP-доступа из Интернета имеют права доступа Только чтение, независимо от того, какие права доступа им здесь предоставлены.</p><p><B>Продолжение или прекращение работы мастера установки</B><BR>Для перехода на следующую страницу нажмите кнопку <B>Продолжить</B>. <BR>Для прекращения работы мастера установки и перехода на экран Настройки USB-накопителя нажмите кнопку <B>Остановить работу мастера</B>.\&quot;max_reached=\&quot;Достигнуто максимальное количество\&quot;swiz_usb=\&quot;Мастер установки – USB-накопитель\&quot;stop_wiz=\&quot;Остановить работу мастера\&quot;continue=\&quot;Продолжить\&quot;enter_login=\&quot;Введите регистрационное имя для этой папки\&quot;share_folder_list=\&quot;Список общих папок\&quot;finish_mark=\&quot;Готово\&quot;dev_no_empty=\&quot;Необходимо ввести имя устройства\&quot;vista_set=\&quot;Настройки Vista\&quot;enable_bult=\&quot;Включить встроенный регистратор\&quot;allow_config_router=\&quot;Разрешить регистратору выполнить настройку роутера\&quot;VST_vista_h=\&quot;<h1>Справка по настройкам Vista</h1></P><p><B>Имя устройства</B><BR>Это дружественное сетевое имя для роутера. роутер отображается на карте сети Vista, а сетевой проводник отмечен этим именем.</p><p><B>Включить встроенный регистратор</B><BR>Если встроенный регистратор включен, можно использовать функцию &quot;Добавить беспроводной клиент&quot; на этой странице для добавления беспроводного клиента в сеть с помощью процедуры WPS. В этом случае для добавления беспроводного клиента не требуется наличия Windows Vista на ПК.</p><p><B>Разрешить регистратору выполнить настройку роутера</B><BR>Выберите эту опцию, чтобы разрешить пользователям настроить роутер с помощью ПК с ОС Windows Vista. При использовании конфигурации роутера по умолчанию пользователи могут выполнить его настройку с помощью ПК с ОС Windows Vista. Однако если роутер был настроен регистратором, необходимо выбрать эту опцию, чтобы этот роутер снова можно было настроить с помощью регистратора. При включении встроенного регистратора эта опция становится неактивной.</p><p><B>Добавить беспроводной клиент </B><BR>Если встроенный регистратор включен, можно нажать эту кнопку, чтобы начать процедуру добавления беспроводного клиента в сеть. После этого появится диалоговое окно с запросом PIN-кода клиента. PIN-код клиента должен отображаться в графическом интерфейсе клиента.</p>",
