"h_wlg_sec_profile=" : "<H1>Справка по настройкам профиля безопасности</H1><P>Данный роутер позволяет пользоваться несколькими беспроводными сетями. Подробные сведения о каждой из беспроводных сетей содержатся в профиле безопасности. Приводятся подробные сведения о профиле безопасности. <UL><LI>Имя профиля <BR>Отображается имя текущего профиля. <LI>SSID <BR>Текущий SSID, связанный с данным профилем. <LI>Безопасность <BR>Отображается текущая система безопасности (например, WPA-PSK). <LI>Включить <BR>Этот флажок позволяет включать или отключать каждый профиль безопасности по мере надобности. Щелкните <B>Применить</B> для сохранения изменений. <LI>WMM <BR>Этот флажок позволяет включать или отключать объявление WMM в каждом профиле безопасности. Щелкните <B>Применить</B> для сохранения изменений. <LI>Передача SSID <BR>Этот флажок позволяет включать или отключать передачу SSID в каждом профиле безопасности. Щелкните <B>Применить</B> для сохранения изменений. </UL></P><p><B>Кнопка Редактировать</B><BR></P><p>После нажатия этой кнопки можно изменять настройки для выбранного профиля. Для выбора требуемого профиля используйте расположенный слева от него переключатель. </P>",
