"h_wds" : "<P><font size=4><B>Справка по настройкам функции беспроводной ретрансляции</B></font></P> <a name=en_repeat></a> <p><B>Включить беспроводную ретрансляцию</B></p> <p>Включите эту функцию, если нужно использовать режим &quot;мост&quot; или режим &quot;ретранслятор&quot;, и затем выберите режим, подходящий для вашего окружения: </p><ul>     <p><li><a name=repeat></a><strong>Беспроводной ретранслятор </strong>  </P><p>В данном режим",
"h_CF_log" : "<P><font size=4><B>Включить в журнал</B></font></P><p>Журнал — это детализированная запись веб-сайтов, которые посещали или пытались посетить пользователи в сети. Если на странице Блокировка сайтов установлена фильтрация содержимого, на странице &apos;Журналы&apos; будут отображаться сообщения о попытках доступа пользователей к заблокированному сайту. Если активированы уведомления по электронной почте, то эти журналы будут поступать в сообщениях электронной почты. Если такие уведомления не настроены, журналы можно просмотреть здесь.</p><p><ul><li>Щелкните <b>Очистить журнал</b>, чтобы удалить все записи в журнале.</ul><p><ul><li>Щелкните <b>Обновить</b>, чтобы увидеть самые последние записи.</ul><p><ul><li>Щелкните <b>Отправить журнал, </b>чтобы отправить файл журнала учетной записи электронной почты. Эта функция используется для тестирования настроек электронной почты.</ul><a name=&quot;syslog&quot;></a><P><b>Syslog</b><p>Журналы могут пересылаться на сервер Syslog. Включите одну из этих трех опций:<ul><li> Отключить – выберите эту опцию, если у вас нет сервера Syslog.<li> Трансляция в локальной сети – данные Syslog транслируются в локальной сети, а не посылаются на указанный сервер Syslog. Используйте эту опцию, если ваш сервер Syslog не имеет фиксированного IP-адреса.<li> Отправить на IP-адрес этого сервера Syslog – если ваш сервер Syslog имеет фиксированный IP-адрес, выберите эту опцию и введите IP-адрес своего сервера Syslog. </ul><p> </p>",
