"welcome_prompt" : "<td><p><ul>Вы подключились к беспроводному роутеру NETGEAR! </ul></p><p><ul>Далее мы поможем вам настроить роутер для использования подключения к Интернету.</ul></p></td>",
"adsl_server_warning" : "Соединение ADSL не обнаружено",
"adsl_info_1" : "<ul><p><strong>роутер не подключен к ADSL-линии.</strong></br>Убедитесь в том, что кабель ADSL-линии надежно подсоединен к настенной розетке и роутеру.</p></ul>",
"adsl_info_2" : "<ul><p><strong>Выполнено ли подключение к ADSL-линии через микрофильтр, преобразователь или сплиттер?</strong></br>Отключите микрофильтр или сплиттер и подключите роутер непосредственно к ADSL-линии.</p></ul>",
"adsl_info_3" : "<ul><p><strong>Кабель ADSL-линии подключен не к тому порту роутера.</strong></br>Убедитесь в том, что кабель ADSL-линии подключен к порту ADSL роутера. При правильном подключении на роутере загорится индикатор ADSL. На этикетке на нижней стороне роутера указывается расположение порта ADSL и индикатора состояния.</p></ul>",
