"h_dsl_bas" : "<h1 class=&quot;helpfile&quot;>Справка по настройкам ADSL</h1><p>Параметры по умолчанию должны соответствовать системе, использующейся вашим поставщиком услуг Интернета</p><ul><li>Метод мультиплексирования - ваш поставщик услуг Интернета должен указать метод мультиплексирования - VC-BASED или LLC-BASED.<li>Виртуальный канал - ваш поставщик услуг Интернета должен указать, какая комбинация VPI/VCI используется в сети.<li>Режим DSL - почти во всех случаях подходит значение по умолчанию - Авто. В редких случаях установка режима ADSL или ADSL2+ вместо автоматического позволяет решить конфликты взаимодействия.</ul>",
"adsl_fw_ver" : "Версия микропрограммного обеспечения ADSL",
