"h_modem_status" : "<p><B>Модем</B>: в данном разделе описывается текущее состояние и настройки модема. <ul> <li>Версия микрокода ADSL – номер версии микрокода ADSL низкого уровня. Он содержится в микрокоде роутера. <li>Состояние модема – текущее состояние ADSL-соединения с телефонной компанией. <li>Скорость нисходящего потока – скорость ADSL-соединения при передаче данных от телефонной компании к роутеру. <li>Скорость восходящего потока – скорость ADSL-соединения при передаче данных от роутера к телефонной компании. <li>VPI – настройка VPI, установленная на странице Настройки ADSL. <li>VCI – настройка VCI, установленная на странице Настройки ADSL. </ul>",
