"h_syslog" : "<P><B>Syslog</B></P><p>Журналы могут пересылаться на сервер Syslog. Включите одну из этих трех опций:<ul><li> Отключить – выберите эту опцию, если у вас нет сервера Syslog.<li> Трансляция в локальной сети – данные Syslog транслируются в локальной сети, а не посылаются на указанный сервер Syslog. Используйте эту опцию, если ваш сервер Syslog не имеет фиксированного IP-адреса.<li> Отправить на IP-адрес этого сервера Syslog – если ваш сервер Syslog имеет фиксированный IP-адрес, выберите эту опцию и введите IP-адрес своего сервера Syslog. </ul>",
"h_nat" : "<p>NAT позволяет всем ПК в локальной сети получать доступ в Интернет через данный роутер, используя общий IP-адрес WAN. В большинстве случаев функция NAT необходима для доступа в Интернет через данный роутер. Можно отключить функцию NAT только в том случае, если вы уверены, что ее использование не требуется. Если функция NAT отключена, данный роутер выполняет только стандартную маршрутизацию.</p>",
