"h_diag_diag" : "<p><font size=4><b>Справка по диагностике</b></font></p><p>Данная страница позволяет выполнять различные задачи диагностики. При нормальной работе они не требуются.</p><a name=&quot;ping&quot;></a><p><b>Эхо-запрос на IP-адрес или на имя хоста</b> Используйте, чтобы отправить пакет &quot;ping&quot; на указанный IP-адрес или на имя хоста. Эта функция часто используется для тестирования соединения. Если время ожидания &quot;истекло&quot; (ответ не получен), как правило, это означает, что точка назначения является недоступной.<br> Однако некоторые сетевые устройства не отвечают на эхо-запрос.<BR><B>Эхо-запрос VPN – </B>если этот параметр включен, пакет &quot;ping&quot; отправляется через VPN-туннель, когда VPN-туннель активирован и функционирует.<a name=&quot;dnslookup&quot;></a><p><b>Выполнение DNS-поиска</b><BR>DNS (сервер доменных имен) преобразует имя в Интернете (например, www.netgear.com) в IP-адрес. Чтобы получить IP-адрес Web-, FTP-, почтового или другого сервера в Интернете, можно выполнить DNS-поиск для обнаружения IP-адреса.</p><a name=&quot;rtable&quot;></a><p><b>Отображение таблицы маршрутизации</b><BR>Данная операция позволяет отобразить внутреннюю таблицу маршрутизации. Данные сведения используются службой технической поддержки и другими сотрудниками, разбирающимися в таблицах маршрутизации.</p><a name=&quot;reboot&quot;></a><p><b>Перезагрузка роутера</b><BR>Данная кнопка позволяет выполнить удаленную перезагрузку. Эта функция может использоваться, если роутер работает нестабильно или не в обычном режиме.</p><p><b>Примечание</b>   При перезагрузке все существующие соединения с роутером (такие, как данное соединение) или через него (например, доступ пользователей локальной сети в Интернет) будут прерваны. Однако подключение к Интернету будет автоматически восстановлено при первой возможности.</p>",
"h_diag_IP" : "<p><font size=4><b>Справка по диагностике</b></font></p><p>Данная страница позволяет выполнять различные задачи диагностики. При нормальной работе они не требуются.</p><a name=&quot;ping&quot;></a><p><b>Эхо-запрос на IP-адрес или на имя хоста</b> Используйте, чтобы отправить пакет &quot;ping&quot; на указанный IP-адрес или на имя хоста. Эта функция часто используется для тестирования соединения. Если время ожидания &quot;истекло&quot; (ответ не получен), как правило, это означает, что точка назначения является недоступной.<br> Однако некоторые сетевые устройства не отвечают на эхо-запрос.<a name=&quot;dnslookup&quot;></a><p><b>Выполнение DNS-поиска</b><BR>DNS (сервер доменных имен) преобразует имя в Интернете (например, www.netgear.com) в IP-адрес. Чтобы получить IP-адрес Web-, FTP-, почтового или другого сервера в Интернете, можно выполнить DNS-поиск для обнаружения IP-адреса.</p><a name=&quot;rtable&quot;></a><p><b>Отображение таблицы маршрутизации</b><BR>Данная операция позволяет отобразить внутреннюю таблицу маршрутизации. Данные сведения используются службой технической поддержки и другими сотрудниками, разбирающимися в таблицах маршрутизации.</p><a name=&quot;reboot&quot;></a><p><b>Перезагрузка роутера</b><BR>Данная кнопка позволяет выполнить удаленную перезагрузку. Эта функция может использоваться, если роутер работает нестабильно или не в обычном режиме.</p><p><b>Примечание</b>   При перезагрузке все существующие соединения с роутером (такие, как данное соединение) или через него (например, доступ пользователей локальной сети в Интернет) будут прерваны. Однако подключение к Интернету будет автоматически восстановлено при первой возможности.</p>",
