"DG009" : "<P><font size=4><B>Справка по настройкам функции беспроводного повторителя</B></font></P><p> Для использования функции беспроводного повторителя на модеме-роутере необходимо настроить вышестоящий роутер.</p><p><b>Настройка вышестоящего роутера:</b> </p><ol><li>Установите флажок <b>Включить функцию беспроводного повторителя</b>.</li><li>Введите SSID вышестоящего роутера.<br>Существуют следующие варианты:<ul><li>Нажмите кнопку <b>Проверка</b>, чтобы найти вышестоящий роутер, и установите кнопку переключателя рядом с SSID вышестоящего роутера.</li><li>Введите SSID вышестоящего роутера в поле <b>SSID вышестоящего роутера</b>.</li></ul></li><li> В разделе <b>Параметры безопасности</b> установите кнопку переключателя в соответствии с режимом безопасности вышестоящего роутера.<br><b>Примечание.</b> Если вы использовали кнопку <b>Проверка</b> для поиска вышестоящего роутера, режим безопасности будет выбран автоматически.</li><li>В поле <b>Фраза-пароль</b> введите пароль вышестоящего роутера. </li><li>Нажмите кнопку <b>Применить</b>.<br>Ваши изменения сохранены. </li></ol>",
