"DG030" : "<h1 class=&quot;helpfile&quot;>Справка по настройкам ADSL</h1><p><b>Чтобы изменить настройки ADSL, сделайте следующее: </b><p>1. Установите флажок <b>Включить этот интерфейс</b>.<p>2. Выберите в меню интерфейс подключения: <p><ul><li>WAN1<li>IPTV1<li>IPTV2</ul><p>Значения нижеследующих параметров будут автоматически отображены для выбранного интерфейса:<p><ul><li><b>Метод мультиплексирования</b>. Ваш провайдер должен сообщить настройку метода мультиплексирования - VC-BASED или LLC-BASED. <li><b>VPI</b>. Ваш провайдер должен сообщить, какая комбинация VPI/VCI используется для вашего плана обслуживания. <li><b>VCI</b>. Ваш провайдер должен сообщить, какая комбинация VPI/VCI используется для вашего плана обслуживания. </ul><p>3. Выберите <b>Режим работы DSL</b> из меню режима работы DSL: <p><ul><li>Авто<li>ADSL<li>ADSL2<li>ADSL2+</ul><p>4. Нажмите кнопку <b>Применить</b>.<p>Ваши настройки будут сохранены.<p><b>Чтобы отменить изменения: </b><p>Нажмите кнопку <b>Отменить</b>, чтобы закрыть страницу без сохранения изменений. <br>",
"DG031" : "<h1 class=&quot;helpfile&quot;>Справка по настройкам IPTV</h1><p>Возможность настройки IPTV появляется, только когда выбран русский язык в интерфейсе.<p>Внимание. Функция перенаправления IPTV работает только при подключении к Интернету через ADSL (а не через порт Ethernet WAN).<p><b>Чтобы настроить функцию перенаправления IPTV, сделайте следующее:</b><p>1. Выберите порты проводной (LAN) и беспроводной (WLAN) сети, на которые будет перенаправлен поток IPTV. <p>2. Нажмите кнопку <b>Применить</b>.<p>Ваши настройки будут сохранены.<p><b>Чтобы отменить изменения: </b><p>Нажмите кнопку <b>Отменить</b>, чтобы закрыть страницу без сохранения изменений. <br>",
