"vlan_help01" : "<h1 class=helpfile>Настройки VLAN-групп </h1><BR><a name=port mapping></a><p><b>Для изменения группировки портов: </b><BR><p> 1. Поддерживается несколько групп привязки портов и WAN-интерфейсов. Каждая группа ведет себя как независимая сеть. </p><p> 2. Для поддержки данной функции необходимо добавить доступные интерфейсы в список группы при помощи кнопки <b>«Добавить» <b>.</p><p> 3. Кнопка <b>«Удалить»</b> удалит интерфейс из выбранной группы и добавит его в группу по умолчанию. </p><p> 4. Нажмите <b>«Применить»</b> для принятия текущих настроек. </p><p> 5. Нажмите <b>«Отмена»</b> для возврата к предыдущим настройкам. </p><p> 6. При изменении настроек VLAN Вы должны будете перезапустить систему IAD для того, чтобы новые настройки вступили в силу. </p>",
