"3G329" : "Справка по мастеру установки",
"3G330" : "<p>Pоутер NETGEAR для мобильной широкополосной связи после подключения к сети необходимо настроить. Для этого используйте мастер установки (мастер попытается выполнить подключение к Интернету с помощью интернет-провайдера) или настройте роутер вручную. Если ранее пользователь не устанавливал подключение вручную, рекомендуется пользоваться мастером установки.",
"3G331" : "<p>Чтобы настроить роутер NETGEAR для мобильной широкополосной связи, используйте информацию, которую вы вводили ранее в руководстве по установке.",
"3G332" : "<p>Для начала работы нажмите <b>Далее</b>.",
"3G333" : "Используемый браузер не поддерживает функцию печати.",
"3G334" : "<p>Pоутер использует следующие настройки. Эти настройки беспроводной сети понадобятся для настройки компьютера для беспроводного подключения к Интернету через роутер.</p>",
"3G335" : "<p><strong>Примечание.</strong> Ваш поставщик услуг мобильного широкополосного Интернета может ограничить объем расходуемого трафика в месяц. Рекомендуется периодически уточнять у поставщика услуг, не превышен ли расход трафика.</p>",
"3G336" : "<p><strong>Внимание!</strong> Распечатайте эту страницу либо запишите настройки на бумаге.</p>",
"3G337" : "<p>Нажмите <strong>Готово</strong>, чтобы завершить настройку.</p>",
"3G338" : "Имя беспроводной сети",
"3G339" : "Профиль мобильной широкополосной связи – Справка",
"3G340" : "На этой странице можно настроить профили мобильной широкополосной связи вашего роутера NETGEAR",
"3G341" : "<p>Профиль мобильной широкополосной связи содержит информацию о соединении для определенной SIM-карты. роутер NETGEAR позволяет настроить до 5 профилей мобильной связи.",
"3G342" : "Профиль мобильной связи позволяют быстро подключиться к Интернету при помощи беспроводного роутера NETGEAR. </p>",
"3G343" : "<p><b>Профиль</b> – имя профиля: используйте имя вашей учетной записи мобильной широкополосной связи.</p>",
"3G344" : "<p><b>PIN-код</b> – PIN-код для SIM-карты</p>",
"3G345" : "<p>Нажмите <b>Проверить</b>, чтобы проверить и применить введенный PIN-код.</p>",
"3G346" : "<p>Нажмите <b>Новый</b>, чтобы создать новый профиль мобильной связи.</p>",
"3G347" : "<p>Нажмите <b>Редактировать</b>, чтобы заменить выбранный профиль мобильной связи новым профилем.</p>",
"3G348" : "<p>Нажмите <b>Применить</b>, чтобы применить настроенные профили мобильной связи для подключения к Интернету.</p>",
"3G349" : "<p>Нажмите <b>Обновить</b>, чтобы обновить состояние соединения</p>",
