"3G352" : "Выбрать профиль",
"3G353" : "Существует два основных режима работы 3G модемов: первый из них – UMTS/WCDMA/TD-SCDMA, второй – CDMA2000 1X/EVDO. Узнайте тип используемого вами модема из его технических характеристик. ",
