"3G355" : "Выберите имя Интернет-провайдера.",
"3G356" : "Персональный идентификационный номер (PIN-код) обычно поставляется вместе с SIM-картой и используется для ее блокировки от несанкционированного использования. Обычно он включает в себя от 4 до 8 цифр. Если вы не знаете, какой PIN-код должен использоваться, свяжитесь с вашим Интернет-провайдером. Примечание: В большинстве случаев пользователю не нужно знать PIN-код, т.к. SIM-карта поставляется незаблокированной. Кроме того, SIM-карта может быть уничтожена после многократного ввода неправильного PIN-кода.",
"3G357" : "Имя точки доступа (APN) является сетевым идентификатором, используемым мобильными устройствами при подключении к оператору мобильной сети. Оператор затем считывает данный параметр для определения типа соединения, которое должно быть создано (например, какой IP-адрес должен быть выдан устройству). Если вы не знаете, какой APN должен быть использован, свяжитесь с вашим провайдером.",
"3G358" : "Это тип протокола, отвечающий за прием и передачу данных между модемом и сетью мобильной сетью оператора. Если вы не знаете тип PDP, свяжитесь с вашим провайдером.",
