"3G497" : "<p> Служба SMS-сообщений — это служба обмена текстовыми сообщениями. Роутер должен быть подключен к сети с использованием действительной SIM-карты.</p><p></p><p>Можно просматривать следующие папки: &apos;Входящие&apos;, &apos;Отправленные&apos; и &apos;Черновики&apos;. Для просмотра содержимого папки выберите требуемую папку в меню.",
"3G498" : "<b>Входящие:</b> страница сводной информации о полученных SMS-сообщениях.<ol>Для просмотра всего текста нажмите на требуемое SMS-сообщение.<br><b>Новое:</b> создание нового сообщения.<br><b>Переслать и ответить:</b> открытие выбранного сообщения для пересылки или ответа на него.<br><b>Обновить:</b> получение всех сообщений.<br><b>Удалить:</b> удаление выбранного сообщения.<br><b>Удалить все:</b> удаление всех сообщений.</ol>",
"3G499" : "<b>Отправленные:</b> страница сводной информации об отправленных SMS-сообщениях.<ol>Для просмотра всего текста нажмите на выбранное SMS-сообщение <br><b>Новое:</b> создание нового сообщения. <br><b>Переслать:</b> открытие выбранного SMS-сообщения для пересылки. <br><b>Повторно отправить:</b> повторная отправка SMS-сообщения. <br><b>Удалить:</b> удаление выбранного SMS-сообщения.<br><b>Удалить все:</b> удаление всех SMS-сообщений на SIM-карте.</ol>",
"3G500" : "<b>Черновики:</b> страница сводной информации о черновиках SMS-сообщений.<ol>Для просмотра всего текста нажмите на выбранное SMS-сообщение <br><b>Новое:</b> создание нового SMS-сообщения. <br><b>Редактировать:</b> открытие выбранного SMS-сообщения для редактирования. <br><b>Отправить:</b> отправка выбранного черновика SMS-сообщения. <br><b>Удалить:</b> удаление выбранного черновика SMS-сообщения.</ol>",
"3G501" : "<b>Новое SMS-сообщение:</b> создание нового SMS-сообщения или сообщения эл. почты.<ol><b>Кому:</b> номер телефона или адрес эл. почты пользователя, которому вы хотите отправить сообщение.<br><b>Содержимое:</b> текст сообщения. В нижней части поля &apos;Содержимое&apos; отображается максимальное количество символов для сообщений.<br><b>Кнопка &apos;Отправить&apos;:</b> кнопка <b>Отправить</b> используется для отправки сообщений.<br><b>Кнопка &apos;Очистить&apos;:</b> кнопка <b>Очистить</b> используется для удаления сообщений. <br><b>Кнопка &apos;Сохранить&apos;:</b> кнопка <b>Сохранить</b> используется для сохранения сообщений в папку &apos;Черновики&apos;. <br><b>Кнопка &apos;Отмена&apos;:</b> кнопка <b>Отмена</b> используется для восстановления сообщения в папке &apos;Входящие&apos;.<br> </ol>",
