"devmodeHelp01" : "<P><font size=4><B>Справка по режиму устройства</B></font></P><p>Когда устройство работает в режиме роутера, на этой странице можно переключиться в режим модема, в котором устройство функционирует как &apos;только мост&apos; или DSL-модем. <p>Маршрутизация, брандмауэр, поддержка беспроводной связи, USB, счетчик трафика в этом режиме недоступны. Типичной областью применения является сценарий для малого и среднего бизнеса, в котором это устройство используется для DSL-подключения после роутера/брандмауэра операторского класса или диспетчера устройств безопасности (Security Device Manager; SDM). Когда устройство работает в режиме модема, на этой странице можно перейти обратно в режим роутера со всеми стандартными функциями.",
