"genie_181" : "Ваше сообщение направлено в NETGEAR. Благодарим за ваш отзыв. Мы читаем все сообщения, но NETGEAR не может отвечать на все отзывы. Если компания NETGEAR не ответила сразу, может пройти несколько дней до отправки ответа.",
"genie_182" : "<p>Чтобы блокировать или разрешить доступ к сети для одного или нескольких устройств, нажмите на ссылку Контроль доступа в правом верхнем углу экрана, после чего откроется экран Контроль доступа, на котором можно внести требуемые изменения.",
"genie_183" : "<p><font size=4><B>Контроль доступа – справка</B></font></p><p>Контроль доступа можно использовать, чтобы разрешать или блокировать доступ к сети для компьютеров и электронных устройств. Когда устройство заблокировано, от роутера можно только получить IP-адрес, при этом он не сможет обмениваться информацией с другими устройствами, а также не сможет подключиться к Интернету.<p><A name=enable_acc_control></A><p><b>Для включения контроля доступа выполните следующие действия:</b><p>Установите флажок <b>Включить контроль доступа</b>. Установка этого флажка позволяет блокировать или разрешать доступ к сети для компьютеров или электронных устройств. Этот флажок необходимо установить, чтобы можно было задать &apos;Правило доступа&apos; и использовать кнопки &apos;Разрешить&apos; и &apos;Блокировать&apos;. Если этот флажок снят, то подключение разрешено для всех устройств, даже тех, которые входят в список блокированных устройств.<p><A name=access_rule></A><p>Переключатели <b>Правило доступа</b>. Установите переключатель рядом с тем правилом доступа, которое требуется задать для новых устройств, пытающихся подключиться к вашей сети. &apos;Правило доступа&apos; не затрагивает ранее блокированные или разрешенные устройства. Оно действует только для устройств, которые будут подключаться к сети после применения этих настроек.<p>По умолчанию выбрана опция &apos;Разрешить подключение всех новых устройств&apos;, поэтому, если вы приобретете новое устройство, оно сможет получить доступ к сети без настройки его MAC-адреса на этой странице.<p>NETGEAR рекомендует оставить выбранной эту опцию. Если же вы выберите опцию &apos;Блокировать подключение всех новых устройств&apos;, то новое устройство не сможет получить доступ к вашей сети, пока вы явным образом не добавите его MAC-адрес в список разрешенных. Например, если новый компьютер использует беспроводное сетевое подключение и проводное подключение к сети Ethernet и для каждого подключения используется свой собственный МАС-адрес, то вам необходимо явным образом добавить оба этих MAC-адреса в список разрешенных.<p>Кнопки <b>Разрешить</b> и <b>Блокировать</b>. Чтобы разрешить или блокировать доступ для конкретного устройства, установите соответствующий флажок и нажмите кнопку &apos;Разрешить&apos; или &apos;Блокировать&apos;, чтобы изменить его состояние.<p>После завершения изменения параметров нажмите кнопку <b>Применить</b>.<p>Для возврата к предыдущим настройкам нажмите кнопку <b>Отмена</b>.",
