"genie_272" : "<P><font size=4><B>Справка по VLAN/IPTV</B></font></P><p>Некоторые интернет-провайдеры (ISP) требуют, чтобы роутеры для подключения к Интернету передавали и принимали пакеты виртуальной локальной сети. Это требование широко распространено для доступа по оптоволоконному каналу.</p><p>Некоторые интернет-провайдеры не могут работать за брандмауэром с преобразованием сетевых адресов (NAT) беспроводного роутера. Вы можете создать сеть без NAT, соединив порт IPTV с портом Интернета.</p><p name=vlan id=vlan></p><p><b>Настройка VLAN</b><p><ol><li> Установите флажок &apos;Включить тег VLAN&apos;.</li><li>Нажмите кнопку &apos;Редактировать&apos;.</li><li>Измените значения параметров &apos;Идентификатор VLAN&apos; и &apos;Приоритет&apos;, а также портов, относящихся к этой группе.</li>Эту информацию можно получить от интернет-провайдера.<br>   <li>Нажмите кнопку &apos;Добавить&apos;.</li></ol><p>Группа VLAN добавлена.</p>Используйте легко запоминающееся имя для группы.</p><p name=iptv id=iptv></p><p><b>Настройка IPTV</b><p><ol><li>1. Снимите флажок &apos;Включить тег VLAN&apos;.</li><li>Нажмите кнопку &apos;Добавить&apos;.</li></ol><p>Порты соединены в режиме &apos;мост&apos;. NAT и брандмауэр не обрабатывают пакеты между соединенными портами, которые работают в режиме &apos;мост&apos;.</p></p>",
