"genie_1015" : "Дома",
"genie_1016" : "Удаленный доступ",
"genie_1017" : "<p>Функция ReadyCLOUD предоставляет удаленный доступ через Интернет к USB-накопителю, подключенному к USB-порту вашего роутера.</p><p><b>Инструкции по настройке ReadyCLOUD</b><br>Шаг 1. Вам необходимо иметь учетную запись ReadyCLOUD. Если у вас нет учетной записи, то для ее создания <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com/client/index.html#page=manage&quot;>нажмите здесь</a> и выберите &quot;Создать учетную запись&quot;.<br> Шаг 2. Перейдите на страницу ReadySHARE интерфейса роутера <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://routerlogin.net&quot;>http://routerlogin.net</a>, выберите вариант ReadyCLOUD и введите свое имя пользователя и пароль для ReadyCLOUD, чтобы зарегистрировать роутер под своей учетной записью ReadyCLOUD.<br>Шаг 3. Снова войдите на веб-сайт <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>http://readycloud.netgear.com</a> под своей учетной записью ReadyCLOUD. Отображается USB-устройство, подключенное к вашему роутеру.<br><b>Примечание. </b>Можно использовать дополнительное приложение для безопасного удаленного подключения к USB-устройству роутера с вашего компьютера или мобильного устройства.<br>Войдите в это приложение, чтобы получить доступ к USB-устройству из любой точки сети. <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>Нажмите здесь</a>, чтобы получить приложение для удаленного доступа.</p>",
