"D-genie_137" : "С использованием функции <B>ТРАССИРОВКА МАРШРУТА</B> идентифицируйте маршрут пакетов данных от вашего компьютера до хоста. Трассировка маршрута позволяет опытным пользователям обнаружить проблемы маршрутизации или наличие брандмауэров, которые могут блокировать доступ вашего компьютера к хосту. Введите имя или IP-адрес хоста и нажмите кнопку.",
"D-genie_138" : "Хост",
"D-genie_139" : "С использованием функции <B>DNS-ПОИСК</B> найдите IP-адрес или имя хоста. Хостом может быть любое устройство, подключенное к сети и имеющее имя (обычно хостом является web-сайт). Введите имя хоста и нажмите кнопку.",
