"D-genie_363" : "Мой роутер перестал работать, а индикатор питания мигает с низкой частотой. Что делать?",
"D-genie_364" : "Если индикатор питания роутера мигает с низкой частотой, это означает что микрокод роутера поврежден. Для восстановления работы роутера можно использовать следующую процедуру. Если данная процедура не поможет, а роутер все еще находится на гарантии, обратитесь в службу технической поддержки NETGEAR.<br><br>Шаг 1. Используя другое интернет-соединение, (например, на работе или в общедоступной точке доступа Wi-Fi), загрузите последнюю версию микрокода с адреса <a href=&apos;http://www.netgear.com&apos;>http://www.netgear.com</a>.<br><br>Шаг 2. При помощи кабеля Ethernet подключите свой компьютер к одному из четырех портов LAN роутера. Настройте на компьютере статический IP-адрес 192.168.1.2 и маску подсети 255.255.255.0.<br><br><B>.</B>&nbsp;&nbsp;<b>Windows</b>. Выберите <b>Панель управления&nbsp;&gt; Сетевые подключения</b>. Правой кнопкой нажмите <b>Подключение по локальной сети </b>и выберите пункт <b>Свойства</b>, затем выделите <b>Протокол lP (TCP/IPv4)</b> и нажмите <b>Свойства</b>. На странице настройки IP, проставьте флажок напротив <b>Использовать следующий IP-адрес</b>, введите <b>192.168.1.2</b> в качестве IP-адреса и <b>255.255.255.0</b> в поле маски подсети, а затем нажмите <b>OK</b>.<br><B>.</B>&nbsp;&nbsp;<b>Linux или Mac</b>. Следуя указаниям Linux или Mac, присвойте компьютеру этот статический IP-адрес.<br><br>Шаг 3. Если используется Windows PC, откройте окно команд, для Linux или Mac воспользуйтесь TFTP-клиентом.<br><br><B>.</B>&nbsp;&nbsp;<b>Windows 7</b>. Нажмите кнопку <b>Пуск</b>. В поле поиска введите <b>cmd</b> и нажмите <b>Enter</b>.<br><B>.</B>&nbsp;&nbsp;<b>Windows XP</b>. Выберите <b>Пуск&nbsp;&gt; Выполнить</b>, введите <b>cmd</b> и нажмите <b>Enter</b>.<br><br>При помощи команды cd перейдите в тот каталог (в папку), в который в ходе выполнения Шага 1 был загружен файл микрокода. Запустите команду <b>tftp -i 192.168.1.1 put имя_файла</b>.<br><br><B>.</B>&nbsp;&nbsp;<b>Linux или Mac</b>. Загрузите и запустите версию TFTP-клиента для вашей ОС.<br><br>Шаг 4. Подождите несколько минут, пока роутер запишет новый микрокод и перезагрузится. После успешного восстановления индикатор питания загорится зеленым цветом.<br><br>Шаг 5. Снова установите динамический IP-адрес на вашем компьютере при помощи процедуры, аналогичной Шагу 2, но на этот раз установите флажок напротив пункта <b>Получить IP-адрес автоматически</b>.",
