"D-genie_564" : "<p><font size=4><b>Справка по имени устройства</b></font></p><p name=mode></p><p><b>Имя устройства.</b> Имя устройства идентифицирует ваш роутер. Многие функции роутера передают это имя на подключенные клиентские устройства для идентификации и отображения. При изменении имени устройства будут изменены все поля ниже. Кроме того, в пути к общему ресурсу ReadySHARE можно указать новое имя устройства.</p><p><b>Имена полей графического интерфейса роутера, в которых отображается это имя устройства</b><br>Ниже указаны имена полей в графическом интерфейсе, в которых отображается это имя устройства, а также страницы, на которых находятся эти поля:<ul><li>Страница настроек Интернета: имя учетной записи</li><li>Страница настроек LAN: имя устройства</li><li>Страница медиасервера: имя медиасервера</li><li>Роутер/точка доступа/режим повторителя > Страница режима точки доступа: имя устройства</li><li>Роутер/точка доступа/режим повторителя > Страница режима повторителя: имя устройства</li></ul></p><p><b>Клиенты, для которых отображается имя устройства</b><br>Имя устройства отображается для следующих клиентов:<ul><li>Сервер iTunes</li><li>Сервер Time Machine</li><li>ReadySHARE Printer или сервер печати Bonjour</li><li>LLTD</li><li>UPNP</li><li>Устройство с WPS</li></ul></p>",
