"RU_manual_conf_1" : "Если вашего провайдера нет в списке, выберите ",
"RU_login_string" : "Укажите, требует ли ваш провайдер ввода логина и пароля для доступа в интернет? Выберите «Да», если вам приходится каждый раз при включении компьютера запускать дополнительное подключение для доступа в интернет вручную. Выберите «Нет», если подключение осуществляется сразу же и ваш провайдер не использует логин и пароль для авторизации пользователей.",
"RU_login_yes_str" : "Вы выбрали «Да». Это означает, что для подключения пользователей ваш провайдер использует т.н. VPN-подключение, которое подразделяется на несколько типов: PPPoE, PPTP или L2TP. Для продолжения установки, вам необходимо знать конкретный тип подключения в вашей сети. Если вы его не знаете, вы можете либо позвонить в службу технической поддержки вашего провайдера, либо на ПК, напрямую подключенному к провайдеру с работающим интернетом, зайти в состояние подключения к интернету и перейти к вкладке «Подробно» (или «Сведения»), где будет указан тип вашего VPN.",
"RU_choose_vpn_str" : "Укажите тип вашего VPN-подключения:",
"RU_login_no_str" : "Вы выбрали «Нет». Это означает, что ваш провайдер либо предоставляет настройки в автоматическом режиме (т.н. режиме DHCP), либо использует статические настройки (фиксированный адрес), которые необходимо задавать вручную пользователю. Вам необходимо выбрать один из режимов в зависимости от того, выдаются ли вам настройки автоматически или вам их необходимо прописывать согласно договору с провайдером.",
"RU_service_optional" : "Имя службы обычно является необязательным к заполнению.",
"RU_pppoe_dual_head" : "Укажите, предоставляет ли ваш провайдер кроме доступа в интернет доступ к локальным ресурсам (например, ftp серверам, локальным торрент трекерам, DC++ хабам, телевиденью IPTV и пр.)? При выборе «Да» в качестве ответа роутер будет использовать схему двойного доступа, характерного только для России (т.н. dual-access). В противном случае весь трафик будет передаваться только через VPN-подключение.",
"RU_intra_ip" : "Внутренний IP-адрес сети провайдера",
"attention_static_ip" : "Внимание! Вы используете фиксированный (статический) IP-адрес для вашего внутреннего интерфейса доступа к локальным ресурсам провайдера. Для того чтобы доступ к ресурсам работал корректно, вам необходимо по завершению текущей настройки указать статические маршруты. Для их настройки перейдите в меню «Статические маршруты» и следуйте соответствующим указаниям в справке. Используйте IP-адрес шлюза, который предоставил вам провайдер, в качестве шлюза назначения для каждого из добавленных маршрутов.",
"RU_finish_head" : "Вы завершили процедуру ручной настойки роутера. Пожалуйста, проверьте ваши настройки еще раз. В случае ошибки вы можете вернуться на соответствующий этап с помощью кнопки «Назад» и исправить допущенные недочеты.",
"RU_finish_tail" : "Щелкните по кнопке «Проверить подключение» для того, чтобы роутер попытался подключиться к интернету.",
"RU_manual_fail_head" : "Pоутеру не удалось подключиться к интернету. Причиной могут быть неверно введенные настройки подключения или проблемы на стороне провайдера. Вы можете вернуться к предыдущим шагам с помощью кнопки «Назад» или начать настройку заново, нажав на кнопку «Начать заново».",
