"Analytics_027" : "NETGEAR, Inc.<br>350 East Plumeria Drive<br>San Jose, CA 95134<br>Телефон головного офиса: 408-907-8000<br>Факс головного офиса: 408-907-8097<br><br>ИЛИ<br><br>NETGEAR International Limited<br>First Floor Building 3 University Technology Centre Curraheen Road<br>Cork, Ireland (Ирландия)<br>Телефон головного офиса: 353-21-2333-200<br>Факс головного офиса: 353 21 2333 299<br><br>© NETGEAR, Inc., 2017. Все права защищены.",
