"Analytics_029" : "2.3 Соответствие нормативным требованиям.  Вы соглашаетесь с тем, что при использовании микрокода или другого программного обеспечения на устройстве, которое не было предоставлено компанией NETGEAR, Вы не можете использовать такой микрокод или другое программное обеспечение для изменения параметров радиосвязи, чтобы эксплуатировать устройство таким образом, который не соответствует требованиям местного законодательства или нормативным актам.",
