"PCVP_042" : "<body bgcolor=#0099cc ><P><font size=4><B> Справка по переадресации порта / инициированию порта </B></font></P><p>Инициирование порта &#150; расширенная функция, которая может использоваться для игр и других Интернет-приложений. Переадресация порта имеет похожие функции, но она статична и имеет некоторые ограничения. </p><p>Инициирование порта временно открывает входной порт и не требует от Интернет-сервера запись вашего IP-адреса, если он, например, был изменен DHCP. </p><p>Инициирование порта отслеживает исходящий трафик. Если маршрутизатор обнаруживает трафик в определенном исходящем порте, он запоминает IP-адрес компьютера, посылающего данные и &quot;инициирует&quot; входящих порт. Входящий трафик на инициируемом порте переадресовывается на инициируемый компьютер.</p><p><a name=select></a>С помощью страницы <B>Переадресация порта / инициирование порта</B> можно сделать локальные компьютеры или серверы доступными для различных Интернет-служб (например, FTP или HTTP), для игр в Интернете (например, Quake III) или для использования Интернет-приложений (например, CUseeMe).</p><p>Переадресация порта разработана для FTP, веб-сервера или других услуг на основе сервера. Как только переадресация порта установлена, запросы из Интернета будут переадресовываться на необходимый сервер. </p><p>Инициирование порта разрешает запросы из Интернета только после того, как указанный порт &apos;инициирован&apos;. Инициирование порта применяется к чату и Интернет-играм.</p><hr><p><a name=pt_enable></a><b>Инициирование портов</b></p><p>Примечание. Если установлен флажок <b>Отключить инициирование портов</b>, то будет отключена функция инициирования <b>всех</b> портов, но информация о настройках останется в маршрутизаторе.</p><p><a name=pt_timeout></a><b>Время ожидания при инициировании портов</b></p><p>Введите значение до 9999 минут. Значение в поле \&quot;Время ожидания при инициировании портов\&quot; определяет установленное время таймера бездействия для заданного входящего порта (портов). Входящий порт (порты) будет закрыт по истечении установленного времени таймера бездействия.</p><p><b> Работа с интернет-играми и приложениями </b></p><p>Перед началом работы необходимо узнать, какую службу, приложение или игру предполагается настроить. Для данной игры или приложения необходимо иметь адрес исходящего порта (порт инициирования).</p><p>Чтобы настроить компьютер для игр в Интернете или для использования интернет-приложений, выполните следующее: <ol> <li> Нажмите кнопку <b>Добавить</b>. </li> <li> Введите имя службы в поле <b>Имя службы</b>.  </li> <li> В поле <b>Пользователь службы</b> выберите <b>Любой</b> (по умолчанию), чтобы данная служба могла использоваться всеми пользователями в вашей сети. Или же выберите <b>Одиночный адрес</b> и введите IP-адрес ПК для разрешения доступа только определенному ПК. </li> <li> Выберите <b>Тип службы</b>. </li> <li> Введите номер исходящего порта в поле<b> Порт инициирования</b>. </li> <li> Введите информацию о входящем порте соединения в поля <b>Тип подключения</b>, <b>Начальный порт</b> и <b>Конечный порт</b>. Эту информацию можно получить из руководства или с веб-сайта поддержки игр или приложений.  </li> <li> Нажмите кнопку <b>Применить</b>.  </li></ol><p>Для редактирования записи службы выполните следующее:<ol> <li>Выберите кнопку переключателя, соответствующую требуемой записи в таблице. </li> <li> Нажмите кнопку <b>Редактировать службу</b>. </li> <li> Измените службу.</li> <li> Нажмите кнопку <b> Применить</b>.</li></ol><p>Для удаления записи службы выполните следующее:<ol> <li>  Выберите кнопку переключателя, соответствующую требуемой записи в таблице. </li> <li>  Нажмите кнопку <b> Удалить службу</b>. </li></ol></body>",
