"PCVP_090": "В режим Рутер единственото устройство, което може да бъде свързано към вашия съществуващ шлюз, е вашият нов рутер NETGEAR. Трябва да свържете всичките си устройства към новия си рутер NETGEAR. Ако съществуващият шлюз има WiFi функция, забранете я.",
"PCVP_091": "Ако желаете да използвате новия си рутер за по-добра WiFi ефективност от тази, която имате със съществуващия си шлюз, препоръчваме Ви да настроите рутера си в режим на точка за достъп. Ако съществуващият Ви шлюз има функция WiFi, препоръчваме Ви да я дезактивирате. С този режим можете да свържете кабелни устройства към съществуващия си шлюз, както и да свържете кабелни и WiFi устройства към новия си рутер.  В режим на точка за безжичен достъп IP адресът на новия рутер се задава по подразбиране динамично от Вашия съществуващ шлюз. Въпреки това, все още можете да посетите <a class='linktype' target='_blank' href='http://www.routerlogin.net'>http://www.routerlogin.net</a> за достъп до уеб интерфейса на рутера от устройство, свързано към рутера. Някои функции на рутера не са налични в режим на точка за безжичен достъп и трябва да използвате режим на рутер, ако искате да използвате тези функции.",
