"RAX5_QOS_3" : "Тест скорости",
"RAX5_QOS_4" : "<p><font size=4><b>Справка по Тест скорости</b></font></p><p>Функция Тест скорости улучшает качество онлайн-игр и потоковой передачи мультимедиа благодаря назначению приоритетов использования полосы пропускания интернет-соединения. Когда роутер обнаруживает игровой или потоковый трафик, он пытается ограничить фоновый трафик, такой как загрузки по BitTorrent или FTP, чтобы повысить качество игры или потоковой передачи мультимедиа. </p><a name=enable_qos></a><p><b>Включить Тест скорости.</b> Включение или отключение функции Тест скорости. </p><a name=ookla_detect></a><p><b>Полоса пропускания интернет-соединения — Разрешить Speedtest определить полосу пропускания интернет-соединения (рекомендуется). </b>Точное определение полосы пропускания интернет-соединения требуется для корректной работы функции Тест скорости. При первой активации функции Тест скорости роутер автоматически запускает Speedtest. Нажмите кнопку <b>Speedtest</b>, чтобы повторно проверить ширину полосы пропускания. Во время работы Speedtest избегайте любых действий в Интернете. </p><a name=manual_define></a><p><b>Полоса пропускания интернет-соединения — Я хочу определить полосу пропускания интернет-соединения. </b>Если вы знаете ширину полосы пропускания интернет-соединения, вы можете установить ее вручную. Максимальное значение равно 1000,00. </p>",
